(3592, 'post', 'cable-tie-act-14inch-black-bag-of-100', NULL, 3484, 'Cable Tie, ACT - 14inch Black (Bag of 100)', '&lt;p&gt;These are the really GOOD cable ties, the best we have to offer. Solid latch-pawls that don''t break or let go when under pressure, resistant to cold temperature fracturing, great cable ties.&lt;/p&gt;\r\n&lt;p&gt;We have tested a lot of cable ties made by many different manufacturers and these are the ones that came through with our stamp of approval.&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;14&amp;quot; Black ties.&lt;/li&gt;\r\n    &lt;li&gt;Low insertion &amp;amp; pull-through force&lt;/li&gt;\r\n    &lt;li&gt;High tensile strength is achieved from one piece, advanced pawl and teeth design&lt;/li&gt;\r\n    &lt;li&gt;Manufactured from filtered nylon reducing particle contamination&lt;/li&gt;\r\n    &lt;li&gt;Angled tail provides quicker initial insertion alignment &amp;amp; tail finger grips allow easier handling &amp;amp; tightening&lt;/li&gt;\r\n    &lt;li&gt;Rounded edges provides added safety &amp;amp; eliminates insulation damage&lt;/li&gt;\r\n    &lt;li&gt;They also have a formulated molding process for consistency&lt;/li&gt;\r\n    &lt;li&gt;For Indoor and Outdoor Use&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:12:07', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:22:59', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
