(3597, 'post', 'test-um-coax-mapper-cable-tester', NULL, 3484, 'Test-um coax mapper cable tester...', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;line-height: normal; margin: 0in 0in 0pt&quot;&gt;The Coax Mapper is a handheld tester for technicians of DBS, CATV, security system and other coax system installations. It speeds up your installation time by helping you find and identify multiple coax cables.&amp;nbsp;It works wonders, especially with three and four room installations.&amp;nbsp;Used in conjunction with the included remote terminators, the Coax Mapper displays PASS, OPEN, or SHORT with just one test button on the main unit. One button also initiates a tone signal.&amp;nbsp;It includes four color coded F connectors and BNC adapters.&lt;/div&gt;', '2012-02-19 19:12:11', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:23:07', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
