(3602, 'post', 'mount-dbs-tennamount', NULL, 3484, 'Mount, DBS TennaMount', '&lt;p&gt;&amp;bull; Tennamount&amp;trade; Mounts Easily on&lt;br /&gt;\r\n&amp;bull; Guttered or Non-Guttered Houses&lt;br /&gt;\r\n&amp;bull; Stack Up To Four&lt;br /&gt;\r\n&amp;bull; VHF/UHF YAGI Antennas&lt;br /&gt;\r\n&amp;bull; Dealer supplies 5 or 10 foot mast &amp;amp; Yagi style antennas&lt;br /&gt;\r\n&amp;nbsp; Your Best Value in a VHF/UHF Antenna mounting bracket.&lt;br /&gt;\r\n&amp;bull; Mount up to 4 Yagi Antennas on the Tennamount&amp;trade; DBS&lt;br /&gt;\r\n&amp;nbsp; mounting system.&lt;br /&gt;\r\n&amp;bull; Adjustable to fit any roof overhang&lt;br /&gt;\r\n&amp;bull; Includes all mounting hardware&lt;/p&gt;', '2012-02-19 19:12:15', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:25:08', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3603, 'post', 'compass-lensatic-liquid-filled', NULL, 3484, 'Compass, Lensatic-Liquid Filled', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 0pt; line-height: normal&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;bull;The Liquid Filled design offers quick reads ensuring reliability and accuracy. &lt;br /&gt;\r\n&amp;bull; Sturdy Metal Case for durable protection.&lt;br /&gt;\r\n&amp;bull; Floating Luminous Dial provides easy to read calculations for efficient operation.&lt;br /&gt;\r\n&amp;bull; Adjustable Luminous Marching Line offers essential features for safety and effectiveness. &amp;bull; Thumb Hold &amp;amp; Magnifying Viewer provides comfort and ease for optimal performance&lt;br /&gt;\r\n&amp;bull; Sighting Hairline feature is ideal for locating positions on map or field for precise installation.&amp;nbsp;&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:12:16', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:25:10', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
