(3607, 'post', 'holland-diplexer-2-amp', NULL, 3484, 'Holland, Diplexer, 2 Amp', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;&lt;span style=&quot;color: #333333&quot;&gt;This high performance satellite/off-air and CATV diplexer allows you to combine (or separating if used in the reverse ) off-air / CATV signals with satellite signals to a common cable. It separates TV and satellite signals prior to satellite receiver input and filters harmonics in the off-air spectrum from satellite conversion devices. Thisdiplexer is specifically designed for Dish Network&amp;rsquo;s DP44 installations, requiring continuous 2 amp power passing.&lt;/span&gt;&lt;/div&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;Low Insertion Loss&lt;/li&gt;\r\n    &lt;li&gt;High Return Loss&lt;/li&gt;\r\n    &lt;li&gt;Increased Stop Band Isolation&lt;/li&gt;\r\n    &lt;li&gt;Designed Specifically for DP44 Switch&lt;/li&gt;\r\n    &lt;li&gt;Color Coded Insulators&lt;/li&gt;\r\n    &lt;li&gt;Dish Approved&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:12:19', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:25:16', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3608, 'post', 'winegard-30-inch-dish-universal-feed', NULL, 3484, 'Winegard, 30 Inch Dish(Universal Feed)', '&lt;a href=&quot;/webstore/spec-sheets/DS2076.pdf&quot; target=&quot;_blank&quot;&gt;&lt;img border=&quot;0&quot; alt=&quot;&quot; src=&quot;/webstore/images/spec-button.jpg&quot; /&gt;&lt;/a&gt;', '2012-02-19 19:12:20', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:25:18', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3609, 'post', 'winegard-30-inch-dish-d-tube-feed', NULL, 3484, 'Winegard, 30 Inch Dish(D Tube Feed)', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;&lt;span&gt;This 30&amp;rdquo; satellite receiving antenna dish system utilizes a D-tube feed support.&amp;nbsp;This dish is designed using the CAD-CAM process.&amp;nbsp;Galvanized steel, used in the manufacturing process, is carbon sheet steel with a zinc-iron alloy coating.&amp;nbsp;Corrosion resistant, these alloys react to scratches and other damage through galvanic action between steel and zinc &amp;ndash; the zinc protects breaks in the coating and prevents further damage after installation.&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:12:21', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:25:20', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3610, 'post', 'winegard-j-pipe-mount-and-foot-1-5-8-od-39-inches', NULL, 3484, 'Winegard, J Pipe Mount and Foot(1 5-8 OD, 39 Inches)', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;&lt;span style=&quot;color: #231f20&quot;&gt;This pipe mount kit is designed to fit on the&lt;/span&gt; &lt;span style=&quot;color: #231f20&quot;&gt;side of a house.&amp;nbsp;Either end of the mast can be &lt;span style=&quot;color: #231f20&quot;&gt;attached to the base, depending on how much&lt;/span&gt; &lt;span style=&quot;color: #231f20&quot;&gt;clearance is required for the antenna. Not recommended for antennas with a boom length longer than 40&amp;quot;.&amp;nbsp;Lag bolts are not included.&amp;nbsp;DIRECTV approved.&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #231f20&quot;&gt;Locate a stud in the area to be installed.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #231f20&quot;&gt;Drill a small pilot hole, to help start threading the lag bolts (5/16 x 3&amp;quot; recommended).&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #231f20&quot;&gt;Apply silicone sealant to back of the base to seal holes.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 10pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #231f20&quot;&gt;Using lag bolts tighten the base to the wall. Make sure mast is plumb.&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:12:22', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:25:22', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3611, 'post', 'winegard-18-inch-dish-d-tube-feed', NULL, 3484, 'Winegard, 18 Inch Dish(D Tube Feed)', '&lt;ul style=&quot;line-height: 100%; margin-top: 8px; font-family: verdana; margin-bottom: 8px; color: #000099; margin-left: 2px; font-size: 8pt&quot;&gt;\r\n    &lt;li style=&quot;font-size: 8pt&quot;&gt;&lt;font color=&quot;#000099&quot; size=&quot;1&quot; face=&quot;verdana&quot;&gt;Reflectors are manufactured from galvanized steel, finished with a 7-step, textured thermoset powder coat&lt;/font&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul style=&quot;line-height: 100%; margin-top: 8px; font-family: verdana; margin-bottom: 8px; color: #000099; margin-left: 2px; font-size: 8pt&quot;&gt;\r\n    &lt;li style=&quot;font-size: 8pt&quot;&gt;&lt;font color=&quot;#000099&quot; size=&quot;1&quot; face=&quot;verdana&quot;&gt;Reflector: 18&amp;quot; inches (46cm)&lt;/font&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul style=&quot;line-height: 100%; margin-top: 8px; font-family: verdana; margin-bottom: 8px; color: #000099; margin-left: 2px; font-size: 8pt&quot;&gt;\r\n    &lt;li style=&quot;font-size: 8pt&quot;&gt;&lt;font color=&quot;#000099&quot; size=&quot;1&quot; face=&quot;verdana&quot;&gt;compatible with Dish Network and DIRECTV LNBs&lt;/font&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul style=&quot;line-height: 100%; margin-top: 8px; font-family: verdana; margin-bottom: 8px; color: #000099; margin-left: 2px; font-size: 8pt&quot;&gt;\r\n    &lt;li style=&quot;font-size: 8pt&quot;&gt;&lt;font color=&quot;#000099&quot; size=&quot;1&quot; face=&quot;verdana&quot;&gt;&lt;b&gt;LNBF NOT INCLUDED&lt;/b&gt;&lt;/font&gt;&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:12:22', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:25:23', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3612, 'post', 'winegard-24-inch-dish-d-tube-feed', NULL, 3484, 'Winegard, 24 Inch Dish(D Tube Feed)', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span style=&quot;font-size: 10pt&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 10pt&quot;&gt;Antenna width 64 cm (25.3 in.)&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span style=&quot;font-size: 10pt&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 10pt&quot;&gt;Galvanized steel 21 ga. &lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span style=&quot;font-size: 10pt&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 10pt&quot;&gt;Weight, antenna only 2.85 Kg. (5 lbs.) &lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span style=&quot;font-size: 10pt&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 10pt&quot;&gt;F/D .59 &lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span style=&quot;font-size: 10pt&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp