(3616, 'post', 'connector-digicon-s-series-rg59-red-bag-of-100', NULL, 3484, 'Connector, Digicon S Series RG59-Red  (bag of 100)', '&lt;p&gt;&amp;bull; Premium RG59 F-connectors for RG59 67% braid thru RG59 trishield&lt;br /&gt;\r\n&amp;nbsp; coaxial cable.&lt;br /&gt;\r\n&amp;bull; Digicon coax connectors terminate with a conical compression&lt;br /&gt;\r\n&amp;bull; The 360 degree conical compression seals connector around cable jacket&lt;br /&gt;\r\n&amp;bull; Digicon S Series die creates compression sledge in connector&lt;br /&gt;\r\n&amp;bull; Digicon connectors include a machined brass sealing ring located&lt;br /&gt;\r\n&amp;nbsp; in the final compression taper to create a permanent water barrier at&lt;br /&gt;\r\n&amp;nbsp; the connector base.&lt;br /&gt;\r\n&amp;bull; A lubricated internal O-ring prevents moisture migration at the mandrel nut.&lt;br /&gt;\r\n&amp;bull; A large ferrule contact surface ensures a proper RF and digital interface.&lt;br /&gt;\r\n&amp;bull; The free-spinning brass tin-plated body &amp;amp; nickel- plated nut provide&lt;br /&gt;\r\n&amp;nbsp; superior corrosion resistance &amp;amp; durability.&lt;br /&gt;\r\n&amp;bull; The connector nut is 50 percent larger, 20 percent deeper, with 30&lt;br /&gt;\r\n&amp;nbsp; percent more threads for a more firm grip &amp;amp; to provide a secure weathertight&lt;br /&gt;\r\n&amp;nbsp; connection. Exceeds SCTE &amp;amp; Telcordia specifications.&lt;br /&gt;\r\n&amp;bull; Bag of 100&lt;/p&gt;', '2012-02-19 19:12:27', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:25:31', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
