(3690, 'post', 'cable-pro-linear-compression-tool', NULL, 3484, 'Cable Pro Linear Compression Tool.', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt; line-height: normal&quot;&gt;&lt;span style=&quot;font-size: 12pt; color: black&quot;&gt;&amp;bull; Works with Ridgeloc 360, DIGICON, PPC &amp;amp; Snap &amp;lsquo;n Seal Connectors for maximum versatility. &lt;br /&gt;\r\n&amp;bull; Use with Digicon RG-6 (DS6), Digicon Quad RG-6Q (DS6Q) type compression coax cable F-connectors ensuring ultimate compatibility.&lt;br /&gt;\r\n&amp;bull; Professional quality compression radial crimp tool delivers perfectly&lt;br /&gt;\r\n&amp;nbsp; round &amp;amp; watertight crimps on RG6 coaxial cable allowing for protection and sturdiness.&lt;br /&gt;\r\n&amp;bull; Light-weight, stainless steel compression tool requires no adjustment&amp;nbsp; &lt;br /&gt;\r\n&amp;nbsp; for compression simplifying the installation process for ease of use.&lt;br /&gt;\r\n&amp;bull; Easy, one-step compression tool creates TRUE 360&amp;ordm; compression connections ensuring superior shielding performance.&lt;br /&gt;\r\n&amp;bull; Creates water-tight, weather-resistant seal to reduce moisture migration and signal radiation leakage for high quality performance.&lt;br /&gt;\r\n&amp;bull; Compresses F-type and RCA connectors for both RG59 and RG6 cable sizes ensure functionality.&lt;br /&gt;\r\n&amp;bull; Made in the USA&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:13:03', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:30:58', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
