(3692, 'post', 'terk-wireless-a-v-entertainment-expansion-system-2-4-ghz', NULL, 3484, 'Terk, Wireless A-V Entertainment Expansion System, 2.4 GHZ', '&lt;ul&gt;\r\n    &lt;li&gt;Transmits video and audio sources to a TV in any room, through walls and floors&lt;/li&gt;\r\n    &lt;li&gt;Provides full two-way remote control operation from anywhere in the home&lt;/li&gt;\r\n    &lt;li&gt;Effective range of up to 150 feet&lt;/li&gt;\r\n    &lt;li&gt;Works with TVs, satellite receivers, DVD players and most other A/V components&lt;/li&gt;\r\n    &lt;li&gt;Expands your entertainment system to more rooms in your home&lt;/li&gt;\r\n    &lt;li&gt;Multiple mounting options&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:13:04', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:31:01', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3693, 'post', 'terk-remote-control-extender-kit-uhf', NULL, 3484, 'Terk, Remote Control Extender Kit(UHF)', '&lt;ul&gt;\r\n    &lt;li&gt;Increases the range of any remote control&lt;/li&gt;\r\n    &lt;li&gt;Allows you to control your satellite receiver, DVD player, personal video recorder, cable box, VCR, stereo receiver or any other controllable component from anywhere, even through walls&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:13:04', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:31:03', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3694, 'post', 'compression-crimp-tool-for-pvfc11', NULL, 3484, 'Compression Crimp Tool For PVFC11', '&lt;p&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;bull; Works with Ridgeloc 360, Digicon S- series F-connectors ( Series 59,6,7,and 11), along with most other compression F-connectors for maximum capability. &amp;nbsp;&lt;br /&gt;\r\n&amp;bull;Light-weight, stainless steel compression tool is designed to easily compress connectors to fit RG59, RG6, RG7 and RG11 with a flip of the die providing ultimate durability.&lt;br /&gt;\r\n&amp;bull; Unique design creates true 360&amp;ordm; compression connections for a professional quality radial crimp. &lt;br /&gt;\r\n&amp;bull; Creates water-tight, weather-resistant seal to reduce and shield moisture migration and signal radiation leakage providing protection and security. &lt;br /&gt;\r\n&amp;bull;Compresses F-Conn&amp;rsquo;s RG11 F-Type Connector (FS11V) for ease of installation.&lt;br /&gt;\r\n&amp;bull; Use with Connector PVFC11 for compatibility. &lt;br /&gt;\r\n&amp;bull; Made in the USA &lt;/span&gt;&lt;/p&gt;', '2012-02-19 19:13:05', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:31:04', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3695, 'post', 'uhf-remote-kit-trans-and-receiver-aaandaaa-green-package', NULL, 3484, 'UHF Remote Kit Trans and Receiver AAandAAA - green package...', '&lt;p&gt;&amp;bull; Includes rechargeable battery, charger transmitter &amp;amp; remote&lt;br /&gt;\r\n&amp;nbsp; signal receiver&lt;br /&gt;\r\n&amp;bull; Does not include remote control&lt;br /&gt;\r\n&amp;bull; Turn your infrared remote into a Digital RF remote&lt;br /&gt;\r\n&amp;bull; Control A/V components up to 100+ feet&lt;br /&gt;\r\n&amp;bull; Works through walls, windows, doors &amp;amp; floors&lt;br /&gt;\r\n&amp;bull; Easy set-up; works with virtually all remotes&lt;br /&gt;\r\n&amp;bull; Place rechargeable battery &amp;amp; transmitter in remote&lt;br /&gt;\r\n&amp;bull; Point receiver unit at infrared A/V components&lt;br /&gt;\r\n&amp;bull; Contains rechargeable battery and charger&lt;br /&gt;\r\n&amp;bull; Freedom to control A/V components from room-to-room&lt;br /&gt;\r\n&amp;bull; Requires no attachments to front of remote&lt;br /&gt;\r\n&amp;bull; Convert more than one remote&lt;br /&gt;\r\n&amp;bull; Patented Technology&lt;br /&gt;\r\n&amp;bull; Basic Frequency&lt;/p&gt;', '2012-02-19 19:13:05', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:31:06', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
