(3704, 'post', 'mount-perfect-vision-npr-for-18inch-and-24inch-dish', NULL, 3484, 'Mount, Perfect Vision NPR for 18inch and 24inch Dish', '&lt;p&gt;&lt;span style=&quot;line-height: 115%; font-family: &amp;quot;Calibri&amp;quot;,&amp;quot;sans-serif&amp;quot;; font-size: 11pt; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: ''Times New Roman''; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA&quot;&gt;This non-penetrating roof mount is designed for to fit both 18&amp;rdquo; and 24&amp;rdquo; dishes. No holes need to be drilled in the roof surface, this avoids reluctance by building owners and reduces the possibly of roof leaks. The total weight of the assembly can be varied by the use of either &amp;ldquo;light&amp;rdquo; concrete blocks or standard weight blocks. This and ALL roof mounted antenna assemblies should be tethered to the building with a flexible steel cable for maximum security.&lt;/span&gt;&lt;/p&gt;', '2012-02-19 19:13:09', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:31:20', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3705, 'post', 'roof-mat-for-npr-mount-38inch-x-24inch', NULL, 3484, 'Roof Mat For NPR Mount - 38inch x 24inch', '&lt;a href=&quot;/webstore/spec-sheets/NPRMAT1.pdf&quot; target=&quot;_blank&quot;&gt;&lt;img border=&quot;0&quot; alt=&quot;&quot; src=&quot;/webstore/images/spec-button.jpg&quot; /&gt;&lt;/a&gt;', '2012-02-19 19:13:09', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:31:22', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3706, 'post', 'rg11-strip-tool', NULL, 3484, 'RG11 Strip Tool', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 0pt; line-height: normal&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;bull; Snap-in-cartridge offers a hassle free installation without screws, keys, or other adjustments getting in the way. &lt;br /&gt;\r\n&amp;bull; Preps RG7 and RG11 cables ensuring high performance for any installation. &lt;br /&gt;\r\n&amp;bull; Patented cable stop creates perfect &amp;frac14;&amp;rdquo;- &amp;frac14;&amp;rdquo; cable preparation for ease and accuracy.&lt;br /&gt;\r\n&amp;bull; Integrated rollers designed to ensure strip tool rolls around the cable while precisely removing debris.&lt;br /&gt;\r\n&amp;bull; Unique design eliminates the correct amount of cable jacket, cuts the foil, braid and dielectric to length, and exposes the center conductor for maximum functionality. &lt;br /&gt;\r\n&amp;bull; Includes a replaceable blade cartridge for ultimate value. &lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:13:09', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:31:24', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3707, 'post', 'pro-strip-cable-stripper-adjustable', NULL, 3484, 'Pro Strip Cable Stripper (Adjustable)', '&lt;p&gt;&amp;bull; Preps RG59 and RG6 cables&lt;br /&gt;\r\n&amp;bull; Patented cable stop creates perfect &amp;frac14;&amp;rdquo;- &amp;frac14;&amp;rdquo; cable preparation&lt;br /&gt;\r\n&amp;bull; Adjustment dial on tool allows installers to locate the perfect setting&lt;br /&gt;\r\n&amp;nbsp; to make a clean, precise cut through the cable&lt;br /&gt;\r\n&amp;bull; Integrated side flaring tool to stretch the jacket on difficult RG6 cables&lt;br /&gt;\r\n&amp;bull; Integrated rollers to ensure strip tool rolls around the cable&lt;br /&gt;\r\n&amp;bull; Includes a replaceable blade cartridge&lt;/p&gt;', '2012-02-19 19:13:10', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:31:25', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL);
