(3711, 'post', 'conn-barrel-100-pc-bag-3ghz-high-freq', NULL, 3484, 'Conn, Barrel 100 pc bag 3GHZ-High Freq', 'The internal components of this fitting are much different from a\r\nstandard VHF/UHF barrel connector. The center coax conductor\r\nindexes into a close-tollerance tube that is resilient (spring) brass\r\nand is gold plated.\r\nThe close center-tube tolerance assures a tight connection, the\r\ngold plating assures a good electrical connection and the overall\r\nperformance is greatly improved over standard designs.\r\nInternally, the center conductor tube is insulated from the inner skin\r\nof the barrel by a maximum air gap which results in much less RF\r\nloss. Insertion loss is extremely low and not really necessary to\r\nconsider in complex systems.\r\n&lt;ul&gt;\r\n&lt;li&gt;Bag of 100&lt;/li&gt;\r\n&lt;li&gt;Double female barrel connector&lt;/li&gt;\r\n&lt;li&gt;Use to join two cables&lt;/li&gt;\r\n&lt;li&gt;Also fits to wall plates&lt;/li&gt;\r\n&lt;li&gt;Used for high frequency cable runs&lt;/li&gt;\r\n&lt;li&gt;3 GHZ&lt;/li&gt;\r\n&lt;li&gt;Internal components\r\ndesigned for high\r\nfrequency&lt;/li&gt;\r\n&lt;li&gt;Gold plated center\r\nconductor assures\r\nminimum RF loss &amp; good\r\nelectrical connections&lt;/li&gt;\r\n&lt;li&gt;Resilient internal metals\r\nfor dependable repeated\r\ninsertion connections&lt;/li&gt;\r\n&lt;li&gt;Can easily be used in wall\r\nplates with your addition\r\nof a thin capture nut&lt;/li&gt;\r\n&lt;li&gt;Minimal insertion loss&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:13:11', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:31:32', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3712, 'post', 'amplifier-20db-with-gain-38-325', NULL, 3484, 'Amplifier, 20dB With Gain  38-325.', '&lt;p&gt;&amp;bull; Distribution amplifier used where the cable distance or&lt;br /&gt;\r\n&amp;nbsp; number of TVs require amplification of original signal&lt;br /&gt;\r\n&amp;bull; Splitters used to divide off-air signal (or modulated receiver&lt;br /&gt;\r\n&amp;nbsp; signal) &amp;amp; send signal to multiple TV&amp;rsquo;s attenuate (reduce)&lt;br /&gt;\r\n&amp;nbsp; signal strength&lt;br /&gt;\r\n&amp;bull; The distribution amplifier pumps up the signal with dB gain&lt;br /&gt;\r\n&amp;nbsp; so a sufficient signal strength is present at each outlet or at&lt;br /&gt;\r\n&amp;nbsp; the end of a long cable run&lt;br /&gt;\r\n&amp;bull; Amplifies without over-driving TV&amp;rsquo;s with too much signal&lt;br /&gt;\r\n&amp;bull; variable gain control&lt;br /&gt;\r\n&amp;bull; Frequency Range: 47-900 MHZ&lt;br /&gt;\r\n&amp;bull; Max Input: VHF: 40dBmV, UHF: 20dBmV&lt;br /&gt;\r\n&amp;bull; Gain: VHF: 20dB UHF: 21dB&lt;br /&gt;\r\n&amp;bull; Noise: VHF: 6dB UHF: 8dB&lt;br /&gt;\r\n&amp;bull; Gain Control: 10dB&lt;br /&gt;\r\n&amp;bull; Power Requirements: 117&lt;br /&gt;\r\n&amp;bull; VAC -60 HZ or 220 VAC&lt;/p&gt;', '2012-02-19 19:13:12', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:31:33', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
