(3719, 'post', 'splitter-2-way-app-2-2300-mhz', NULL, 3484, 'Splitter, 2-Way APP 2-2300 Mhz', '&lt;p&gt;&lt;span style=&quot;line-height: 115%; font-family: Calibri; font-size: 11pt; mso-bidi-font-family: Calibri; mso-fareast-font-family: ''Times New Roman''; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA&quot;&gt;This 2-way, power passing splitter has a high performance printed-board circuitry and a vigorous epoxy sealed back cover. It has DC power passing to all ports, yellow-chromate plating, a zinc alloy cast housing and mounting tabs with screws.&lt;/span&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;90 dB min RFI Shielding&lt;/li&gt;\r\n    &lt;li&gt;Epoxy-Sealed Back-Cover&lt;/li&gt;\r\n    &lt;li&gt;High-Performance Printed-Board Circuitry&lt;/li&gt;\r\n    &lt;li&gt;Improved Hum Modulation and Inter-modulation&lt;/li&gt;\r\n    &lt;li&gt;Yellow-Chromate Plating&lt;/li&gt;\r\n    &lt;li&gt;Zinc-Alloy Cast Housing&lt;/li&gt;\r\n    &lt;li&gt;3/8˝ Precision Machined F-Connector Threads&lt;/li&gt;\r\n    &lt;li&gt;Mounting Tabs with Screws&lt;/li&gt;\r\n    &lt;li&gt;Cast-In Ground Block&lt;/li&gt;\r\n    &lt;li&gt;DC Power Passing to One or All Ports for Remote LNB-Powering Applications and Powering Antenna Pre-Amplifier from Headend&lt;/li&gt;\r\n    &lt;li&gt;F-ports accommodate security tools&lt;/li&gt;\r\n    &lt;li&gt;DC Power Passing to All Ports&lt;/li&gt;\r\n    &lt;li&gt;DC Power Forward Bias&lt;/li&gt;\r\n    &lt;li&gt;Insertion Loss: 4.6 dB max.&lt;/li&gt;\r\n    &lt;li&gt;Port-Port Isolation: 15 dB min.&lt;/li&gt;\r\n    &lt;li&gt;Input Return Loss: 30 dB min.&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:13:14', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:32:26', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
