(3736, 'post', 'ridgeloc-compression-rg6-connector-50-bag', NULL, 3484, 'Ridgeloc Compression, RG6 Connector (50 Bag)', '&lt;p&gt;This connector fits any standard non-plenum RG-6 75 Ohm single-foil wrap coax cable.&lt;/p&gt;\r\n&lt;p&gt;The RIDGELOC 360&amp;rsquo;s textured sleeve cylinder and the end bell capture rings prevent backing up regardless of where the end bell is located on the sleeve after compression. The coax is POSITIVELY captured by the end bell every time. Use ANY Standard compression tool with a compression length approximately 21 millimeters &amp;plusmn; and the RIDGELOC 360 always installs correctly for maximum quality and performance. The RIDGELOC 360 is suitable for indoor applications and is completely SCTE tested and weatherproof for hostile outdoor environments. Other features include a extremely rugged machined body, mil spec plating, dimpled grip and available customizable imprint on the identification band at the rear of the end bell.&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;50 RG6 connectors per bag&lt;/li&gt;\r\n    &lt;li&gt;High performance F-type connector&lt;/li&gt;\r\n    &lt;li&gt;Quick, easy installation on all RG6 and RG6 Dual coax.&lt;/li&gt;\r\n    &lt;li&gt;Designed for CATV, DSS and broadband installation&lt;/li&gt;\r\n    &lt;li&gt;Precision machined body with mil spec plating&lt;/li&gt;\r\n    &lt;li&gt;Passed stringent moisture migration testing to SCTE standards.&lt;/li&gt;\r\n    &lt;li&gt;Dimpled Grip&lt;/li&gt;\r\n    &lt;li&gt;Patented compression ridges lock in for a fool proof installation every time.&lt;/li&gt;\r\n    &lt;li&gt;Designed to work with any standard compression tool (21mm)&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:13:21', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:33:02', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3737, 'post', 'ground-clamp-2-piece-fits-1-2-1-ul', NULL, 3484, 'Ground Clamp, 2 piece fits 1-2- 1(UL)', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;This two piece ground clamp fits pipers between &amp;frac12;&amp;rdquo; and 1&amp;rdquo;.&amp;nbsp;It is UL/CUL Listed.&amp;nbsp;The two jaws (clamps) are made of copper alloy and the bolts have slotted round heads and are made of zinc plated steel.&amp;nbsp;Use in conjunction with other grounding supplies to protect against lightning strikes and power surges.&lt;/div&gt;', '2012-02-19 19:13:21', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:33:04', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
