(3787, 'post', 'terminator-dc-blocking-100-bag', NULL, 3484, 'Terminator DC Blocking 100 Bag', '&lt;p&gt;&amp;bull; All ports of splitters, multiswitches, etc. either open or not used, must be capped off&lt;br /&gt;\r\n&amp;bull; Terminators diminish signal loss&lt;br /&gt;\r\n&amp;bull; Increases signal force &amp;amp; protects port from water &amp;amp; corrosion damages&lt;br /&gt;\r\n&amp;bull; 75 OHM&lt;br /&gt;\r\n&amp;bull; Bag of 100&lt;/p&gt;', '2012-02-19 19:13:42', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:43:36', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3788, 'post', 'ground-block-single-high-freq', NULL, 3484, 'Ground Block, Single High Freq', '&lt;ul&gt;\r\n    &lt;li&gt;Use for high frequency run to ground satellite antenna &amp;amp; coax&lt;/li&gt;\r\n    &lt;li&gt;Run to ground block then to receivers&lt;/li&gt;\r\n    &lt;li&gt;Protects receivers from lightning strikes&lt;/li&gt;\r\n    &lt;li&gt;Ground wire passes through block &amp;amp; to grounding rod&lt;/li&gt;\r\n    &lt;li&gt;This model is used to for one coax line&lt;/li&gt;\r\n    &lt;li&gt;3 GHz&amp;nbsp;&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:13:43', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:43:38', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
