(3790, 'post', 'ground-bk-dual-w2-grd-lugs-3-ghz-hf-ul', NULL, 3484, 'Ground BK DuaL w2 Grd Lugs 3 GHZ HF (UL)', '&lt;p&gt;&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;This high frequency dual ground block has a gold plated center which assures a great connection. The internal components are designed for high frequency and low loss.&amp;nbsp;Rated for 0MHz to 3GHz.&amp;nbsp;UL Listed.&amp;nbsp;Resilient internal metals for dependable repeated insertion connections.&amp;nbsp;Minimal insertion and return loss numbers.&amp;nbsp;Two mounting screws are provided with each block.&lt;/div&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;The internal components of these ground blocks are much different from the standard frequency VHF/UHF ground block.&amp;nbsp;The center coax conductor indexes into a close-tolerance tube that is resilient (spring) brass and is gold plated.&amp;nbsp;The close center-tube tolerance assures a tight connection the gold plating assures a good electrical connection and the overall performance is greatly improved over standard designs.&lt;/div&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:13:44', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:43:41', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3791, 'post', 'ground-block-dual-with-3-grounding-lugs', NULL, 3484, 'Ground Block, Dual With 3 Grounding Lugs.', 'Ground, Block, Dual, 5-1000 MHz, 3 Gnd Lug, Zinc Alloy', '2012-02-19 19:13:44', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:43:43', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
