(3907, 'post', 'phonex-easy-jack-set-transmitter-receiver-6-phone-cord', NULL, 3484, 'Phonex, Easy Jack Set(Transmitter-Receiver-6'' Phone Cord)', '&lt;ul&gt;\r\n    &lt;li&gt;Phonex Easy Jack 2 turns any electrical outlet into a phone connection for satellite receivers, DVRs, postage-meter machines, dial-up modems &amp;amp; more&lt;/li&gt;\r\n    &lt;li&gt;Avoid charges for not having phone connection for satellite receiver&lt;/li&gt;\r\n    &lt;li&gt;Order movies by pressing a button on remote&amp;nbsp;&lt;/li&gt;\r\n    &lt;li&gt;Download postage instead of making a call&lt;/li&gt;\r\n    &lt;li&gt;Contents: 1 base unit, 1 extension unit, 6-foot phone cord, owner&amp;rsquo;s manual, &amp;amp; warranty card&lt;/li&gt;\r\n    &lt;li&gt;Measurements: 2.9&amp;rdquo; x 4.10&amp;rdquo; x 2&amp;rdquo; each unit&lt;/li&gt;\r\n    &lt;li&gt;Audio Bandwidth: 200-3800 Hz&lt;/li&gt;\r\n    &lt;li&gt;FM Carrier Frequency: 4.4 MHz &amp;ndash; 7.6 MHz&lt;/li&gt;\r\n    &lt;li&gt;Maximum number of units: One base unit; up to eight extension units&lt;/li&gt;\r\n    &lt;li&gt;Operating Temperature: 0-50 C (32-122 F)&lt;/li&gt;\r\n    &lt;li&gt;RJ11 plugs only&lt;/li&gt;\r\n    &lt;li&gt;For Telephone Dail - up use only&lt;/li&gt;\r\n    &lt;li&gt;Phonex Modem / Phone Jack Set&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:14:37', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:47:01', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3908, 'post', '2inch-pipe-adapter', NULL, 3484, '2inch Pipe Adapter', '&lt;p&gt;&lt;span style=&quot;line-height: 115%; font-family: Calibri; font-size: 11pt; mso-bidi-font-family: Calibri; mso-fareast-font-family: ''Times New Roman''; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA&quot;&gt;This 2&amp;rdquo; piper adapter allows you to install a smaller DBS antenna on top of an existing metal pipe. Typically, any steel pipe which is securely mounted and stationary will work. The adapter has a slotted end which slips down over the exposed open end of a pipe and then tightens down with two provided grade five hex head bolts. The attached adapter then provides a smaller diameter short mounting pole for the smaller antennas. This adapter is 2.0&amp;rdquo; O.D. and is grey powder coated. We suggest that this device secures best to round pipes. Flat steel does not provide enough grip.&lt;/span&gt;&lt;/p&gt;', '2012-02-19 19:14:37', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-15 17:47:03', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
