uot;margin: 0in 0in 0pt; line-height: normal&quot;&gt;&lt;span style=&quot;font-size: small&quot;&gt;&lt;span style=&quot;font-family: Tahoma&quot;&gt;&lt;span style=&quot;color: #0d0d0d&quot;&gt;&amp;bull; All ends feature 8/32 threads&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;  &lt;div style=&quot;margin: 0in 0in 0pt; line-height: normal&quot;&gt;&lt;span style=&quot;font-size: small&quot;&gt;&lt;span style=&quot;font-family: Tahoma&quot;&gt;&lt;span style=&quot;color: #0d0d0d&quot;&gt;&amp;bull; Couplers are zinc plated to prevent corrosion&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;  &lt;div style=&quot;margin: 0in 0in 0pt; line-height: normal&quot;&gt;&lt;span style=&quot;font-size: small&quot;&gt;&lt;span style=&quot;font-family: Tahoma&quot;&gt;&lt;span style=&quot;color: #0d0d0d&quot;&gt;&amp;bull; Contained in clear plastic carry case with end caps&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;  &lt;div style=&quot;margin: 0in 0in 0pt; line-height: normal&quot;&gt;&lt;span style=&quot;font-size: small&quot;&gt;&lt;span style=&quot;font-family: Tahoma&quot;&gt;&lt;span style=&quot;color: #0d0d0d&quot;&gt;&amp;bull; Extremely flexible&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;  &lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;&lt;span style=&quot;font-size: small&quot;&gt;&lt;span style=&quot;font-family: Tahoma&quot;&gt;&lt;span style=&quot;color: #0d0d0d; line-height: 115%&quot;&gt;&amp;bull; The rods will &amp;ldquo;charge&amp;rdquo; under light while in the clear case&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;  &lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:14:38', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 13:47:14', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3912, 'post', 'satellite-signal-locator-ultra', NULL, 3484, 'Satellite Signal Locator Ultra', '\r\n\r\n&lt;p&gt;The BirDog Ultra satellite finder is a small (6½ x 6½ x 2 ½”), lightweight (2.7 lbs w/ case) signal meter. It has become the meter of choice because of its ability to rapidly find the satellite and peak the dish to the highest signal due to compatibility with the latest encryption coding, including 8PSK Turbo. The meter comes preloaded with the most popular satellites but is also programmable from its own website, &lt;a href=&quot;http://www.birdog.tv/&quot; target=_blank&gt;www.birdog.tv&lt;/a&gt;, and allows the user to load the meter with only the files needed (Over 256 different files can be stored). The BirDog Ultra model has an easy to use spectrum display, a digital constellation screen and many other features, including a custom carrier feature wherein the user can create their own file on site. The meter comes with both an A/C and a D/C charging cord for its rechargeable battery and has a backlight for use in low light conditions.&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Positive identification of most popular satellites \r\n&lt;li&gt;Internal Li-Po battery provides average 6 hour run time \r\n&lt;li&gt;Updateable satellite identification files via your internet connection \r\n&lt;li&gt;Backlit LCD display for evening /night use \r\n&lt;li&gt;Durable carrying case provided with neck strap \r\n&lt;li&gt;DTV SWiM capable \r\n&lt;li&gt;Dual bar graph display for SWiM \r\n&lt;li&gt;Over 256 programmable satellite transponder files \r\n&lt;li&gt;Eighteen custom carrier files \r\n&lt;li&gt;DISEqC capable \r\n&lt;li&gt;Visual Spectrum Display &lt;/li&gt;&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:14:39', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 13:47:17', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3913, 'post', 'perfect-vision-heating-element-slimline', NULL, 3484, 'Perfect Vision Heating element, Slimline', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;PVHSSL&amp;nbsp;The HotShot heating element has an automatic thermostat that turns on just above freezing temperatures and off when the dish surface heats up. The HotShot heating element is an exclusive patented invention of Perfect 10, has been offered for over 13 years and is used by many thousands of dish owners in snowy climates to aid reception when the weather gets testy. This blanket is designed to be powered by the HSPS24AC7AMP-S.&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;Durable vinyl material lasts a long time&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;Etched foil resistance heating element&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;Multiple heat zones apply the maximum heat where it&amp;rsquo;s needed most&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;3M Acrylic adhesive assures a tight bond to the antenna&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&amp;nbsp;Conforms to the reflectors curves and angles&lt;/div&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;This power supply provides 24 volts of AC power to the blanket and that power should NOT be exceeded.&lt;/div&gt;', '2012-02-19 19:14:39', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 13:47:19', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3914, 'post', 'conn-barrel-indoor-50-pc-bag-3ghz-high-freq-nut-washer', NULL, 3484, 'Conn, Barrel Indoor, 50 pc bag 3GHZ-High Freq, Nut-Washer', '\r\n&lt;p style=&quot;LINE-HEIGHT: normal; MARGIN: 0in 0in 0pt; mso-layout-grid-align: none&quot; class=MsoNormal&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;This is a high frequency barrel connector used as an in-line splice connector.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&amp;nbsp; &lt;/span&gt;The internal components of this fitting are much different from a standard VHF/UHF barrel connector. The center coax conductor indexes into a close tolerance tube that is resilient (spring) brass and is gold plated. The close center-tube tolerance assures a tight connection, the gold plating assures a good electrical connection and the overall performance is greatly improved over standard designs.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&amp;nbsp; &lt;/span&gt;Internally, the center conductor tube is insulated from the inner skin of the barrel by a maximum air gap which results in much less RF loss. Insertion loss is extremely low and not really necessary to consider in complex systems. They come 50 barrels per package.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&amp;nbsp; &lt;/span&gt;DIRECTV approved.&lt;?xml:namespace prefix = o ns = &quot;urn:schemas-microsoft-com:office:office&quot; /&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;LINE-HEIGHT: normal; TEXT-INDENT: -0.25in; MARGIN: 0in 0in 0pt 0.5in; mso-layout-grid-align: none; mso-add-space: auto; mso-list: l0 level1 lfo1&quot; class=ListParagraphCxSpFirst&gt;&lt;span style=&quot;FONT-FAMILY: Symbol; mso-bidi-font-family: Symbol; mso-fareast-font-family: Symbol&quot;&gt;&lt;span style=&quot;mso-list: Ignore&quot;&gt;·&lt;span style=&quot;FONT: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;Internal components are designed for high frequency.&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;LINE-HEIGHT: normal; TEXT-INDENT: -0.25in; MARGIN: 0in 0in 0pt 0.5in; mso-layout-grid-align: none; mso-add-space: auto; mso-list: l0 level1 lfo1&quot; class=ListParagraphCxSpMiddle&gt;&lt;span style=&quot;FONT-FAMILY: Symbol; mso-bidi-font-family: Symbol; mso-fareast-font-family: Symbol&quot;&gt;&lt;span style=&quot;mso-list: Ignore&quot;&gt;·&lt;span style=&quot;FONT: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;Gold plated center conductor assures minimum RF loss &amp;amp; good electrical connections.&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;LINE-HEIGHT: normal; TEXT-INDENT: -0.25in; MARGIN: 0in 0in 0pt 0.5in; mso-layout-grid-align: none; mso-add-space: auto; mso-list: l0 level1 lfo1&quot; class=ListParagraphCxSpMiddle&gt;&lt;span style=&quot;FONT-FAMILY: Symbol; mso-bidi-font-family: Symbol; mso-fareast-font-family: Symbol&quot;&gt;&lt;span style=&quot;mso-list: Ignore&quot;&gt;·&lt;span style=&quot;FONT: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;Resilient internal metals for dependable repeated insertion connections.&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;LINE-HEIGHT: normal; TEXT-INDENT: -0.25in; MARGIN: 0in 0in 0pt 0.5in; mso-layout-grid-align: none; mso-add-space: auto; mso-list: l0 level1 lfo1&quot; class=ListParagraphCxSpMiddle&gt;&lt;span style=&quot;FONT-FAMILY: Symbol; mso-bidi-font-family: Symbol; mso-fareast-font-family: Symbol&quot;&gt;&lt;span style=&quot;mso-list: Ignore&quot;&gt;·&lt;span style=&quot;FONT: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;Can easily be used in wall plates using the included washer and nut.&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;LINE-HEIGHT: normal; TEXT-INDENT: -0.25in; MARGIN: 0in 0in 0pt 0.5in; mso-layout-grid-align: none; mso-add-space: auto; mso-list: l0 level1 lfo1&quot; class=ListParagraphCxSpMiddle&gt;&lt;span style=&quot;FONT-FAMILY: Symbol; mso-bidi-font-family: Symbol; mso-fareast-font-family: Symbol&quot;&gt;&lt;span style=&quot;mso-list: Ignore&quot;&gt;·&lt;span style=&quot;FONT: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;Minimal insertion loss.&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;LINE-HEIGHT: normal; TEXT-INDENT: -0.25in; MARGIN: 0in 0in 0pt 0.5in; mso-layout-grid-align: none; mso-add-space: auto; mso-list: l0 level1 lfo1&quot; class=ListParagraphCxSpLast&gt;&lt;span style=&quot;FONT-FAMILY: Symbol; mso-bidi-font-family: Symbol; mso-fareast-font-family: Symbol&quot;&gt;&lt;span style=&quot;mso-list: Ignore&quot;&gt;·&lt;span style=&quot;FONT: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;Indoor use only.&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;', '2012-02-19 19:14:39', 'y', NULL, NULL, NULL, 'n', NULL, 