(3915, 'post', 'ppc-compression-f-connector-rg59-red-bag-of-50-20120219151004', NULL, 3484, 'PPC, Compression F Connector(RG59)(RED)(Bag of 50)', '\r\n&lt;p style=&quot;LINE-HEIGHT: normal; MARGIN: 0in 0in 10pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto&quot; class=MsoNormal&gt;&lt;span style=&quot;COLOR: black; mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;This PPC CMP® RG59 compression connector presents a high value, cable-specific compression connector solution.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&amp;nbsp; &lt;/span&gt;It is compatible with industry standard tools, designed to fit both 60% and Tri-shield coax cables. Comes 50 connectors per bag.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&amp;nbsp; &lt;/span&gt;DIRECTV approved.&lt;?xml:namespace prefix = o ns = &quot;urn:schemas-microsoft-com:office:office&quot; /&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;ul type=disc&gt;\r\n&lt;li style=&quot;LINE-HEIGHT: normal; MARGIN: 0in 0in 10pt; COLOR: black; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-list: l0 level1 lfo1; tab-stops: list .5in&quot; class=MsoNormal&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;Rugged DuPont Delrin compression sleeve&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt; \r\n&lt;li style=&quot;LINE-HEIGHT: normal; MARGIN: 0in 0in 10pt; COLOR: black; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-list: l0 level1 lfo1; tab-stops: list .5in&quot; class=MsoNormal&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;Nickel-plated brass for superior environmental protection&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt; \r\n&lt;li style=&quot;LINE-HEIGHT: normal; MARGIN: 0in 0in 10pt; COLOR: black; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-list: l0 level1 lfo1; tab-stops: list .5in&quot; class=MsoNormal&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;EPDM o-ring seal always in compression sealing regardless of torque&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt; \r\n&lt;li style=&quot;LINE-HEIGHT: normal; MARGIN: 0in 0in 10pt; COLOR: black; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-list: l0 level1 lfo1; tab-stops: list .5in&quot; class=MsoNormal&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;Gas-tight seal connection between nut and post&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt; \r\n&lt;li style=&quot;LINE-HEIGHT: normal; MARGIN: 0in 0in 10pt; COLOR: black; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-list: l0 level1 lfo1; tab-stops: list .5in&quot; class=MsoNormal&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;Triple redundant sealing grooves eliminate moisture ingress&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt; \r\n&lt;li style=&quot;LINE-HEIGHT: normal; MARGIN: 0in 0in 10pt; COLOR: black; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-list: l0 level1 lfo1; tab-stops: list .5in&quot; class=MsoNormal&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;Works with compression tool VT200&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/li&gt;&lt;/ul&gt;', '2012-02-19 19:14:40', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:10:04', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3916, 'post', 'ppc-compression-f-connector-rg6-blue-bag-of-50-20120219151007', NULL, 3484, 'PPC, Compression F Connector(RG6)(BLUE)(Bag of 50)', '&lt;ul&gt;\r\n    &lt;li&gt;Bandwidth: 0 MHz to 3 GHz&lt;/li&gt;\r\n    &lt;li&gt;Impedance: 75 Ohms (nominal)&lt;/li&gt;\r\n    &lt;li&gt;Return Loss: Minimum -30 dB to 3 GHz&lt;/li&gt;\r\n    &lt;li&gt;Insertion Loss: Less than .10 dB to 3 GHz&lt;/li&gt;\r\n    &lt;li&gt;Operating Voltage: 90 V (at 60 Hz continous AC)&lt;/li&gt;\r\n    &lt;li&gt;Operating Temperature: -40&amp;deg; F to + 140&amp;deg; F (-40&amp;deg; C to 60&amp;deg; C)&lt;/li&gt;\r\n    &lt;li&gt;Cable Retention: 50 lbs (22.73 kg) minimum&lt;/li&gt;\r\n    &lt;li&gt;Meets or Exceeds all SCTE Specifications&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:14:40', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:10:07', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
