(3918, 'post', 'ground-block-scte-quad-with-ws', NULL, 3484, 'Ground Block, SCTE Quad with WS', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;The internal components of this ground blocks are much different from a standard frequency VHF/UHF ground block. The center coax conductor indexes into a close-tolerance tube that is resilient (spring) brass and is gold plated. The close center-tube tolerance assures a tight connection, the gold plating assures a good electrical connection and the overall performance is greatly improved over standard designs. DIRECTV approved.&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;SCTE Outdoor Compliant bonding block&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;Rated for 0 MHz to 3 GHz&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;One inch spacing between centers of ports&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;UV resistant rubber weather seals provided&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;UL approved&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;Internal components designed for high frequency and low loss&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;Gold plated center conductor assures good connections&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;Resilient internal metals for dependable repeated insertion connections&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;Minimal insertion and return loss numbers&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 10pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;Two mounting screws are provided with each block&lt;/div&gt;', '2012-02-19 19:14:41', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:10:17', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3919, 'post', 'directv-rf-remote-backlit-universal-ir-rf-2-way-program', NULL, 3484, 'DirecTV, RF Remote, Backlit, Universal(IR-RF)(2-Way Program)', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;line-height: normal; margin: 0in 0in 8.2pt&quot;&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;This universal DIRECTV remote control replaces lost or broken remotes and controls up to 4 AV components. It is designed to operate all of the features of the DIRECTV receiver and it works with any DIRECTV receiver. It has an extensive universal library code which ensures compatibility with most audio and video devices. The four-position MODE slide switch is great for easy component selection and code search to help you program the controller of older or discontinued components. It includes a guide, list, channel and mute functions.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 1.1pt 0.5in&quot;&gt;&lt;span style=&quot;color: #1b1b1b; font-size: 10pt&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;Replacement remote for all previous models of DIRECTV Receivers&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 1.1pt 0.5in&quot;&gt;&lt;span style=&quot;color: #1b1b1b; font-size: 10pt&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;Replaces the RC65RB&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 1.1pt 0.5in&quot;&gt;&lt;span style=&quot;color: #1b1b1b; font-size: 10pt&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;This unit operates on IR and RF frequencies&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 1.1pt 0.5in&quot;&gt;&lt;span style=&quot;color: #1b1b1b; font-size: 10pt&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;RF capable universal remote, for control from anywhere in the house when used with RF compatible receivers&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 1.1pt 0.5in&quot;&gt;&lt;span style=&quot;color: #1b1b1b; font-size: 10pt&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;It controls up to 4 components, including a DIRECTV receiver&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 1.1pt 0.5in&quot;&gt;&lt;span style=&quot;color: #1b1b1b; font-size: 10pt&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;It has a very large library code for popular video and stereo components&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 1.1pt 0.5in&quot;&gt;&lt;span style=&quot;color: #1b1b1b; font-size: 10pt&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;Memory protection to secure against re-programming during battery replacement is included&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 1.1pt 0.5in&quot;&gt;&lt;span style=&quot;color: #1b1b1b; font-size: 10pt&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;H25RFANT &lt;span style=&quot;color: #1b1b1b&quot;&gt;RF dongle is not included&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:14:41', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:10:19', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
