(3924, 'post', 'applied-instruments-satellite-signal-meter-w-29-v-module', NULL, 3484, 'Applied Instruments, Satellite Signal Meter w-29 V Module', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;SUPERBUDDY29&amp;nbsp;&amp;nbsp;&amp;nbsp; This satellite meter identifies the satellite by &amp;ldquo;align-to-lock&amp;rdquo; or &amp;ldquo;automatic scan&amp;rdquo; and the positive ID multi-lock algorithm eliminate false positives.&amp;nbsp;It includes a built in 29V module. It comes with a rugged, durable aluminum case with rubber shock guards.&lt;/div&gt;\r\n&lt;ul type=&quot;disc&quot;&gt;\r\n    &lt;li style=&quot;line-height: normal; margin: 0in 0in 10pt; color: black&quot;&gt;Field replaceable connectors&lt;/li&gt;\r\n    &lt;li style=&quot;line-height: normal; margin: 0in 0in 10pt; color: black&quot;&gt;Geo-sensitive &amp;ldquo;Field Guide&amp;rdquo; software stores all satellites and transponders per region&lt;/li&gt;\r\n    &lt;li style=&quot;line-height: normal; margin: 0in 0in 10pt; color: black&quot;&gt;Zip code entry provides antenna azimuth and vertical angle settings&lt;/li&gt;\r\n    &lt;li style=&quot;line-height: normal; margin: 0in 0in 10pt; color: black&quot;&gt;Controls multi-LNBs / switches with 22kHz / DiSEqC&lt;/li&gt;\r\n    &lt;li style=&quot;line-height: normal; margin: 0in 0in 10pt; color: black&quot;&gt;Large back-lit graphic LCD&lt;/li&gt;\r\n    &lt;li style=&quot;line-height: normal; margin: 0in 0in 10pt; color: black&quot;&gt;Easy to use single function front panel buttons&lt;/li&gt;\r\n    &lt;li style=&quot;line-height: normal; margin: 0in 0in 10pt; color: black&quot;&gt;Displays cross-pole value from HughesNet modems&lt;/li&gt;\r\n    &lt;li style=&quot;line-height: normal; margin: 0in 0in 10pt; color: black&quot;&gt;Able to manually enter new satellites using front panel keypad&lt;/li&gt;\r\n    &lt;li style=&quot;line-height: normal; margin: 0in 0in 10pt; color: black&quot;&gt;Audible tone for signal lock and peak&lt;/li&gt;\r\n    &lt;li style=&quot;line-height: normal; margin: 0in 0in 10pt; color: black&quot;&gt;Quick charge battery with universal AC or vehicle 12VDC&lt;/li&gt;\r\n    &lt;li style=&quot;line-height: normal; margin: 0in 0in 10pt; color: black&quot;&gt;Computer interface for future upgrades&lt;/li&gt;\r\n    &lt;li style=&quot;line-height: normal; margin: 0in 0in 10pt; color: black&quot;&gt;29V module built in&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:14:44', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:23:30', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3925, 'post', 'hughesnet-hn7000-modem-new-or-reconditioned', NULL, 3484, 'HughesNet, HN7000 Modem (New or Reconditioned)', '&lt;p&gt;The HughesNet HN7000 modem &amp;mdash; designed to deliver higher speeds and improved performance for all HughesNet service plans. The HN7000 receives and transmits data over the satellite through the HughesNet network. The HN7000 is compatible with Windows&amp;reg; and Macintosh&amp;reg; operating systems, and connects effortlessly with your computer via simple Ethernet connection.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Features&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;Compatibility with Windows and Macintosh computers&lt;/li&gt;\r\n    &lt;li&gt;Self hosting / no software to load &amp;mdash; automatically upgrades software when new versions become available&lt;/li&gt;\r\n    &lt;li&gt;No phone line needed &amp;mdash; uses two-way satellite communication for setup and operation&lt;/li&gt;\r\n    &lt;li&gt;Ethernet connection &amp;mdash; provides easy connection to your computer or home network&lt;/li&gt;\r\n    &lt;li&gt;User friendly LED indicating terminal operational status.&lt;/li&gt;\r\n    &lt;li&gt;High Performance Speeds via (PEP)&lt;/li&gt;\r\n    &lt;li&gt;Acts as a local router providing dynamic addressing DHCP server.&lt;/li&gt;\r\n    &lt;li&gt;Hassle free ,Configuration, status monitoring, and commissioning via the HughesNet''s Network Operation Center.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&lt;strong&gt;Advantages&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;Software and configuration updates via download from the HughesNet''s Network Operation center (NOC)&lt;/li&gt;\r\n    &lt;li&gt;Implements Performance Enhancement Proxy (PEP) software to accelerate throughput performance by optimizing the TCP transmission over the satellite, delivering superior user experience and link efficiency&lt;/li&gt;\r\n    &lt;li&gt;Implements TurboPage software to accelerate HTTP traffic for fast browser access&lt;/li&gt;\r\n    &lt;li&gt;Quality of Service features include: IQoS (Inbound Quality of Service), bidirectional DSCP, and outbound bandwidth management&lt;/li&gt;\r\n    &lt;li&gt;Supports HughesNet VPN Accelerator&lt;/li&gt;\r\n    &lt;li&gt;Bi-directional data compression&lt;/li&gt;\r\n    &lt;li&gt;Configuration, status monitoring, and commissioning via the NOC&lt;/li&gt;\r\n    &lt;li&gt;Acts as a local router providing:\r\n    &lt;ul&gt;\r\n        &lt;li&gt;Static and dynamic addressing&lt;/li&gt;\r\n        &lt;li&gt;DHCP server or relay&lt;/li&gt;\r\n        &lt;li&gt;DNS caching&lt;/li&gt;\r\n        &lt;li&gt;Full RIPV2 routing support&lt;/li&gt;\r\n        &lt;li&gt;Multicasts to the LAN by using IGMP&lt;/li&gt;\r\n        &lt;li&gt;NAT/PAT&lt;/li&gt;\r\n        &lt;li&gt;VLAN tagging&lt;/li&gt;\r\n        &lt;li&gt;Firewall support through integrated access control lists&lt;/li&gt;\r\n        &lt;li&gt;User friendly LED display indicating terminal operational status&lt;/li&gt;\r\n    &lt;/ul&gt;\r\n    &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:14:44', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:23:33', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
