(3928, 'post', 'coax-rg6-solid-copper-burial-single-ground-1000-ft-dtv-black', NULL, 3484, 'Coax RG6 Solid Copper Burial Single Ground-1000 Ft DTV Black', '&lt;div style=&quot;margin: 9pt 9pt 5pt 6pt&quot;&gt;&lt;span style=&quot;font-size: 10pt&quot;&gt;This black, burial, single, RG-6 coax cable is UL Listed, has a solid copper conductor wire, DIRECTV approved, SBCA compliant, includes a grounding wire and comes in an easy to use 1000&amp;rsquo; pull box with internal rolling reel.&amp;nbsp;It is swept tested to 3 GHz, 60% aluminum braiding, 100% shielded, PVC jacket and foamed polyethylene.&lt;/span&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;Impedance:&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp;75 Ohms&amp;nbsp;&amp;plusmn; 3 Ohms&lt;/li&gt;\r\n    &lt;li&gt;Capacitance:&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 16.2 PF/ft &amp;plusmn; 1.0 PF/ft&lt;/li&gt;\r\n    &lt;li&gt;Velocity of Propagation:&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp;83%&lt;/li&gt;\r\n    &lt;li&gt;Nominal Delay:&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp;1.22 NS/ft&lt;/li&gt;\r\n    &lt;li&gt;Conductor DC Resistance: &amp;nbsp;22 Ohms / Km&lt;/li&gt;\r\n    &lt;li&gt;Shield DC Resistance:&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 43 Ohms / Km&lt;/li&gt;\r\n    &lt;li&gt;Swept Tested:&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;5 MHZ~3000 Mhz&lt;/li&gt;\r\n    &lt;li&gt;UL:&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; CATV / CM&lt;/li&gt;\r\n    &lt;li&gt;Footage markers:&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp;Every 2 ft&amp;nbsp;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;/div&gt;', '2012-02-19 19:14:45', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:23:41', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
