(3932, 'post', 'perfect-vision-heating-element-hs18-full-size-vinyl', NULL, 3484, 'Perfect Vision Heating Element, HS18 full size - Vinyl.', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;The HotShot heating element has an automatic thermostat that turns on just above freezing temperatures and off when the dish surface heats up. The HotShot heating element is an exclusive patented invention of Perfect 10, has been offered for over 13 years and is used by many thousands of dish owners in snowy climates to aid reception when the weather gets testy.&amp;nbsp;It is designed to fit dishes that are 18&amp;rdquo;x20&amp;rdquo; or slightly larger. This is a low-voltage device and should be powered by one of our low voltage power supplies like the HSPS24AC3AMP or the HSPS24AC7AMP-S. Both of these power supplies provide 24 volts of AC power to the heater and that voltage should NOT be exceeded.&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: black&quot;&gt;Durable vinyl plastic material lasts a long time&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: black&quot;&gt;Low voltage design&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;Dependable snap-action bimetallic thermostat&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 10pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: black&quot;&gt;3M self-stick adhesive assures a tight bond to the antenna&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:14:47', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:23:51', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3933, 'post', 'ground-block-scte-dual-with-ws', NULL, 3484, 'Ground Block, SCTE Dual with WS', '&lt;p&gt;&lt;span style=&quot;color: black&quot;&gt;The internal components of this dual ground block are much different from a standard frequency VHF/UHF ground block. The center coax conductor indexes into a close-tolerance tube that is resilient (spring) brass and is gold plated. The close center-tube tolerance assures a tight connection, the gold plating assures a good electrical connection and the overall performance is greatly improved over standard designs. DIRECTV approved.&lt;/span&gt;&lt;/p&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -24.6pt; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; SCTE Outdoor Compliant bonding block.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -24.6pt; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Rated for 0 MHz to 3 GHz.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -24.6pt; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; One inch spacing between centers of ports.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -24.6pt; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; UV resistant rubber weather seals provided.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -24.6pt; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; UL approved.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -24.6pt; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Internal components designed for high frequency and low loss.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -24.6pt; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Gold plated center conductor assures good connections.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -24.6pt; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Resilient internal metals for dependable repeated insertion connections.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -24.6pt; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Minimal insertion and return loss numbers.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -24.6pt; margin: 0in 0in 10pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Two mounting screws are provided with each block.&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:14:47', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:23:54', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3934, 'post', 'directv-wall-mount-for-h25-receiver', NULL, 3484, 'DirecTV, Wall Mount for H25 Receiver', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;line-height: normal; margin: 0in 0in 1.1pt&quot;&gt;&lt;b&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;H25MNT &lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;The H25MNT wall mount bracket provides a simple and convenient way to attach the DIRECTV H25 satellite receiver to a wall near the television. This wall mount is made of a sturdy plastic frame that holds the H25 satellite receiver firmly in place and allows cabling to be routed neatly from the H25 satellite receiver to the television. &lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; margin: 0in 0in 1.1pt&quot;&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 1.1pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;DIRECTV Approved&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 1.1pt 0.5in&quot;&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: black&quot;&gt;Customers can now access both front and rear panels of IRD for easier visual troubleshooting with agents.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 1.1pt 0.5in&quot;&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: black&quot;&gt;Cabling will be less likely come loose due to frequent moving of the IRD.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 1.1pt 0.5in&quot;&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: black&quot;&gt;Customers with wall mounted TV&amp;rsquo;s can now have the IRD located on the wall behind the TV keeping all cabling hidden from view.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 1.1pt 0.5in&quot;&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: black&quot;&gt;The wall mount bracket also includes space &lt;/span&gt;for the &lt;a title=&quot;DIRECTV RF Remote Dongle Adapter for the H25 Receiver (H25RFANT)&quot; href=&quot;http://www.wiredathome.com/directv-rf-remote-dongle-adapter-for-the-h25-receiver-h25rfant/&quot;&gt;&lt;span style=&quot;color: windowtext; text-decoration: none; text-underline: none&quot;&gt;RF dongle&lt;/span&gt;&lt;/a&gt;&amp;nbsp;which&lt;span style=&quot;color: black&quot;&gt; is required if mounting the receiver behind a TV or cabinet.&amp;nbsp;&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:14:48', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:23:55', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3935, 'post', 'dtv-sweep-kit-rg6-coax-50-feet', NULL, 3484, 'DTV Sweep Kit,  RG6 Coax 50 feet', '\r\n&lt;p style=&quot;LINE-HEIGHT: normal; MARGIN: 0in 0in 0pt; mso-layout-grid-align: none&quot; class=MsoNormal&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;Use the DIRECTV Sweep Kit to protect coax wires where they are typically exposed to damage from lawn mowers or “weed eaters”.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&amp;nbsp; &lt;/span&gt;These plastic sweeps can be attached to a house or to the pole mount for the satellite dish where they shield the coax wire from damage due to yard maintenance.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&amp;nbsp; &lt;/span&gt;The sweeps have thick walls and a large inside diameter that can accommodate coax up to RG-6 quad shield with a Siamese ground wire. Each kit includes two ABS plastic sweep sleeves and 50’ of RG-6 dual shield PVCX7B coax cable.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&amp;nbsp; &lt;/span&gt;DIRECTV approved.&lt;?xml:namespace prefix = o ns = &quot;urn:schemas-microsoft-com:office:office&quot; /&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;LINE-HEIGHT: normal; TEXT-INDENT: -0.25in; MARGIN: 0in 0in 0pt 0.5in; mso-layout-grid-align: none; mso-add-space: auto; mso-list: l0 level1 lfo1&quot; class=ListParagraphCxSpFirst&gt;&lt;span style=&quot;FONT-FAMILY: Symbol; mso-bidi-font-family: Symbol; mso-fareast-font-family: Symbol&quot;&gt;&lt;span style=&quot;mso-list: Ignore&quot;&gt;·&lt;span style=&quot;FONT: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;Sweeps are UV stable ABS plastic.&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;LINE-HEIGHT: normal; TEXT-INDENT: -0.25in; MARGIN: 0in 0in 0pt 0.5in; mso-layout-grid-align: none; mso-add-space: auto; mso-list: l0 level1 lfo1&quot; class=ListParagraphCxSpMiddle&gt;&lt;span style=&quot;FONT-FAMILY: Symbol; mso-bidi-font-family: Symbol; mso-fareast-font-family: Symbol&quot;&gt;&lt;span style=&quot;mso-list: Ignore&quot;&gt;·&lt;span style=&quot;FONT: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;Heavy duty screw mounting tabs.&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;LINE-HEIGHT: normal; TEXT-INDENT: -0.25in; MARGIN: 0in 0in 0pt 0.5in; mso-layout-grid-align: none; mso-add-space: auto; mso-list: l0 level1 lfo1&quot; class=ListParagraphCxSpLast&gt;&lt;span style=&quot;FONT-FAMILY: Symbol; mso-bidi-font-family: Symbol; mso-fareast-font-family: Symbol&quot;&gt;&lt;span style=&quot;mso-list: Ignore&quot;&gt;·&lt;span style=&quot;FONT: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;font face=Calibri&gt;Easy and fast installation.&lt;o:p&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;', '2012-02-19 19:14:48', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:23:57', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
