&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;Memory protection to secure against re-programming during battery replacement is included&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 1.1pt 0.5in&quot;&gt;&lt;span style=&quot;color: #1b1b1b; font-size: 10pt&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;H25RFANT &lt;span style=&quot;color: #1b1b1b&quot;&gt;RF dongle is not included&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:14:52', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:34:53', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
