(3971, 'post', 'winegard-j-pipe-mount-and-foot-1-5-8-od-39-inches-20120219154621', NULL, 3484, 'Winegard, J Pipe Mount and Foot(1 5-8 OD, 39 Inches)', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;&lt;span style=&quot;color: #231f20&quot;&gt;This pipe mount kit is designed to fit on the&lt;/span&gt; &lt;span style=&quot;color: #231f20&quot;&gt;side of a house.&amp;nbsp;Either end of the mast can be &lt;span style=&quot;color: #231f20&quot;&gt;attached to the base, depending on how much&lt;/span&gt; &lt;span style=&quot;color: #231f20&quot;&gt;clearance is required for the antenna. Not recommended for antennas with a boom length longer than 40&amp;quot;.&amp;nbsp;Lag bolts are not included.&amp;nbsp;DIRECTV approved.&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #231f20&quot;&gt;Locate a stud in the area to be installed.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #231f20&quot;&gt;Drill a small pilot hole, to help start threading the lag bolts (5/16 x 3&amp;quot; recommended).&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 0pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #231f20&quot;&gt;Apply silicone sealant to back of the base to seal holes.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-indent: -0.25in; margin: 0in 0in 10pt 0.5in&quot;&gt;&lt;span&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #231f20&quot;&gt;Using lag bolts tighten the base to the wall. Make sure mast is plumb.&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:15:05', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:46:21', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3972, 'post', 'winegard-18-inch-dish-d-tube-feed-20120219154625', NULL, 3484, 'Winegard, 18 Inch Dish(D Tube Feed)', '&lt;ul style=&quot;line-height: 100%; margin-top: 8px; font-family: verdana; margin-bottom: 8px; color: #000099; margin-left: 2px; font-size: 8pt&quot;&gt;\r\n    &lt;li style=&quot;font-size: 8pt&quot;&gt;&lt;font color=&quot;#000099&quot; size=&quot;1&quot; face=&quot;verdana&quot;&gt;Reflectors are manufactured from galvanized steel, finished with a 7-step, textured thermoset powder coat&lt;/font&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul style=&quot;line-height: 100%; margin-top: 8px; font-family: verdana; margin-bottom: 8px; color: #000099; margin-left: 2px; font-size: 8pt&quot;&gt;\r\n    &lt;li style=&quot;font-size: 8pt&quot;&gt;&lt;font color=&quot;#000099&quot; size=&quot;1&quot; face=&quot;verdana&quot;&gt;Reflector: 18&amp;quot; inches (46cm)&lt;/font&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul style=&quot;line-height: 100%; margin-top: 8px; font-family: verdana; margin-bottom: 8px; color: #000099; margin-left: 2px; font-size: 8pt&quot;&gt;\r\n    &lt;li style=&quot;font-size: 8pt&quot;&gt;&lt;font color=&quot;#000099&quot; size=&quot;1&quot; face=&quot;verdana&quot;&gt;compatible with Dish Network and DIRECTV LNBs&lt;/font&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul style=&quot;line-height: 100%; margin-top: 8px; font-family: verdana; margin-bottom: 8px; color: #000099; margin-left: 2px; font-size: 8pt&quot;&gt;\r\n    &lt;li style=&quot;font-size: 8pt&quot;&gt;&lt;font color=&quot;#000099&quot; size=&quot;1&quot; face=&quot;verdana&quot;&gt;&lt;b&gt;LNBF NOT INCLUDED&lt;/b&gt;&lt;/font&gt;&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:15:05', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:46:25', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3973, 'post', 'connector-digicon-s-series-rg6-blue-bag-of-100-20120219154629', NULL, 3484, 'Connector, Digicon S Series RG6-Blue.  (bag of 100)', '&lt;ul&gt;\r\n    &lt;li&gt;Premium RG6 F-connectors for RG6 60% braid thru RG6 tri-shield coaxial cable&lt;/li&gt;\r\n    &lt;li&gt;Digicon coax connectors terminate with a conical compression&lt;/li&gt;\r\n    &lt;li&gt;The 360 degree conical compression seals connector around cable jacket&lt;/li&gt;\r\n    &lt;li&gt;Digicon S Series die creates compression sledge in connector&lt;/li&gt;\r\n    &lt;li&gt;Digicon connectors include a unique machined brass sealing ring located in the final compression taper to create a permanent water barrier at connector base.&lt;/li&gt;\r\n    &lt;li&gt;A lubricated internal O-ring prevents moisture migration at the mandrel nut.&lt;/li&gt;\r\n    &lt;li&gt;A large ferrule contact surface ensures a proper RF &amp;amp; digital interface.&lt;/li&gt;\r\n    &lt;li&gt;The free-spinning brass tin-plated body &amp;amp; nickel-plated nut provide superior corrosion resistance &amp;amp; durability&lt;/li&gt;\r\n    &lt;li&gt;The connector nut is 50 percent larger, 20 percent deeper, with 30 percent more threads for a firmer grip &amp;amp; to provide a secure weathertight connection.&lt;/li&gt;\r\n    &lt;li&gt;Bag of 100&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:06', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:46:29', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3974, 'post', 'dsl-in-line-filter', NULL, 3484, 'DSL IN LINE FILTER', '&lt;p&gt;DSL lines can produce unwanted audible tones that you can hear. This device provides a quick and easy solution without digging into walls or rewiring your phone system. Just plug the DSLFILTER into the modular phone jack in the wall and plug your phone into the modular socket.&lt;/p&gt;\r\n&lt;p&gt;Your satellite receiver has to &amp;lsquo;call home&amp;rsquo; at regular intervals, DSL lines can interfere with the connection and cause the satellite receiver to error out and indicate no phone line connection. Just plug the DSLFILTER into your phone line, plug your satellite receiver into the socket and resolve the issue.&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;Simple to install.&lt;/li&gt;\r\n    &lt;li&gt;Filters most bothersome audible DSL tones that you can hear.&lt;/li&gt;\r\n    &lt;li&gt;Allows Satellite receivers to communicate on DSL lines.&lt;/li&gt;\r\n    &lt;li&gt;Install one of these at each telephone for complete coverage.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:06', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:46:38', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
