(3979, 'post', 'silicone-dielectric-compound-5-3-oz-boss-440-clear-20120219154939', NULL, 3484, 'Silicone Dielectric Compound 5.3 Oz (Boss 440 Clear)', '&lt;ul&gt;\r\n    &lt;li&gt;Silicon dioxide thickened dimethyl polysiloxane based material&lt;/li&gt;\r\n    &lt;li&gt;Smooth, easily spreadable dielectric compound, useful as a protectorant for electrical circuitry&lt;/li&gt;\r\n    &lt;li&gt;Designed for use as a protectorant compund for electronic and electrical apparatus to prevent electrical power from migrating between circuitry&lt;/li&gt;\r\n    &lt;li&gt;Found use on switches, high voltage insulators, battery terminals, meters, electrical connectors, buss bar and many other electrical components&lt;/li&gt;\r\n    &lt;li&gt;Excellent release agent and lubricant for plastics, rubbers and glass&lt;/li&gt;\r\n    &lt;li&gt;Heat stable, chemically inert, water repellent - offers superior protection&lt;/li&gt;\r\n    &lt;li&gt;5.3 oz. tube&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:15:08', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:49:39', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL);
