(3982, 'post', 'cable-flex-clips-single-screw-1-2inch-depth-wht-bag-100', NULL, 3484, 'Cable Flex Clips, Single, screw, 1-2inch depth, Wht, Bag-100', '&lt;p&gt;&amp;bull; Superior design avoids stress on the cable &amp;amp; stress on the clip&lt;br /&gt;\r\n&amp;bull; Integrity of signal is unimpeded &amp;amp; life of&lt;br /&gt;\r\n&amp;nbsp; clip is virtually unmatched&lt;br /&gt;\r\n&amp;bull; Manufactured from a pliable, durable polyethylene&lt;br /&gt;\r\n&amp;bull; Wraps around cable without exerting&lt;br /&gt;\r\n&amp;nbsp; pressure on coax&lt;br /&gt;\r\n&amp;bull; Adjustable teeth&lt;br /&gt;\r\n&amp;bull; Each clip can accommodate additional&lt;br /&gt;\r\n&amp;nbsp; ground or messenger wire&lt;br /&gt;\r\n&amp;bull; Screws eliminate chance of accidental damage from tools&lt;br /&gt;\r\n&amp;bull; Designed for ground wire--penetrates&lt;br /&gt;\r\n&amp;nbsp; the surface 1/2&amp;rdquo; &lt;br /&gt;\r\n&amp;bull; Holds single cable&lt;br /&gt;\r\n&amp;bull; White in color&lt;br /&gt;\r\n&amp;bull; Bag of 100&lt;/p&gt;', '2012-02-19 19:15:09', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:49:53', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3983, 'post', '4-split-bolt-ul-approved', NULL, 3484, '#4 Split Bolt- UL Approved', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;line-height: normal; margin: 0in 0in 10pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;Use this split bolt to join two or more ground wires together.&amp;nbsp;&lt;/span&gt;It enables you to &lt;span style=&quot;color: black&quot;&gt;splice ground wires from ground blocks to the existing electrical system ground wire or keep your antenna NEC compliant by grounding the antenna metal structure to an existing electrical system ground wire.&lt;/span&gt;&lt;/div&gt;\r\n&lt;ul type=&quot;disc&quot;&gt;\r\n    &lt;li style=&quot;line-height: normal; margin: 0in 0in 10pt; color: black&quot;&gt;The nut is backed off, insert wires under the head of bolt &amp;amp; tighten nut&lt;/li&gt;\r\n    &lt;li style=&quot;line-height: normal; margin: 0in 0in 10pt; color: black&quot;&gt;The nut forces a sliding center T-shaped anvil up against the two wires &amp;amp; crushes&amp;nbsp;them against the underside of the bolt head.&lt;/li&gt;\r\n    &lt;li style=&quot;line-height: normal; margin: 0in 0in 10pt; color: black&quot;&gt;UL Approved&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:10', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:49:59', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3984, 'post', 'applied-instruments-satellite-signal-meter-w-id-scan', NULL, 3484, 'Applied Instruments, Satellite Signal Meter w-ID Scan', '&lt;ul&gt;\r\n    &lt;li&gt;ID the satellite by &amp;ldquo;align-to-lock&amp;rdquo; or &amp;ldquo;automatic scan&amp;rdquo;&lt;/li&gt;\r\n    &lt;li&gt;Positive ID multi-lock algorithm eliminates false positives&lt;/li&gt;\r\n    &lt;li&gt;Field replaceable connectors&lt;/li&gt;\r\n    &lt;li&gt;Rugged durable aluminum case with rubber shock guards&lt;/li&gt;\r\n    &lt;li&gt;Geo-sensitive &amp;ldquo;Field Guide&amp;rdquo; software stores all satellites and transponders per region&lt;/li&gt;\r\n    &lt;li&gt;Zip code or Lat/Long entry provides antenna azimuth, elevation, and tilt/skew settings for all satellites&lt;/li&gt;\r\n    &lt;li&gt;Controls multi-LNBs/switches with 22kHz/DiSEqC&lt;/li&gt;\r\n    &lt;li&gt;Large back-lit graphic LCD&lt;/li&gt;\r\n    &lt;li&gt;Easy to use single function front panel buttons&lt;/li&gt;\r\n    &lt;li&gt;Displays cross-pol value from HughesNet Ku Band modems&lt;/li&gt;\r\n    &lt;li&gt;Able to manually enter new satellites using front panel keypad&lt;/li&gt;\r\n    &lt;li&gt;Audible tone for signal lock and peak&lt;/li&gt;\r\n    &lt;li&gt;Quick charge battery with universal AC or vehicle 12 VDC&lt;/li&gt;\r\n    &lt;li&gt;Computer interface for future upgrades&lt;/li&gt;\r\n    &lt;li&gt;Store measurements for proof-of-performance &amp;ldquo;POP Scan&amp;rdquo;&lt;/li&gt;\r\n    &lt;li&gt;Pass/Fail for key transponders &amp;ldquo;Limit Scan&amp;rdquo;&lt;/li&gt;\r\n    &lt;li&gt;LOCKs on new multi-rate / ACM signal style used by WildBlue and Telesat/Xplornet&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:10', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:50:02', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3985, 'post', 'terk-antenna-outdoor-amplified-clip-on-elliptical-dish', NULL, 3484, 'Terk, Antenna, Outdoor, Amplified, Clip On - Elliptical Dish', '&lt;ul&gt;\r\n    &lt;li&gt;Installs easily without tools on 18&amp;quot; x 20-24&amp;quot; multi-satellite dishes&lt;/li&gt;\r\n    &lt;li&gt;Clips on to existing satellite dish&lt;/li&gt;\r\n    &lt;li&gt;Picks up VHF, UHF and HD signals so consumers can enjoy local programming along with satellite programming&lt;/li&gt;\r\n    &lt;li&gt;Internal amplifier minimizes signal loss&lt;/li&gt;\r\n    &lt;li&gt;Built-in diplexer combines satellite and antenna signals on one cable&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:15:11', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:50:03', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
