(3987, 'post', 'acutrac-22-pro-mk2-kit', NULL, 3484, 'Acutrac 22 Pro Mk2 Kit.', '\r\n\r\n&lt;p&gt;This meter is a simple and tough field strength meter for most satellite antennas.&amp;nbsp; It can work with virtually any LNB which has an intermediate (downconverted) frequency of 900 ~ 2200 MHz.&amp;nbsp; You can use this meter on C-band, K-band, etc as long as the IF is in the correct range.&lt;/p&gt;\r\n&lt;p&gt;The meter case is cast aluminum. All three F connector attachment points are field replaceable with any high-frequency capable F-81 like our &lt;strong&gt;PV05F81HF&lt;/strong&gt; or similar connector.&lt;/p&gt;\r\n&lt;p&gt;The meter comes complete with an internal NiMH rechargeable battery, a wall charger, a vehicle charger and a protective carrying case.&lt;/p&gt;\r\n&lt;p&gt;This meter is built by the same manufacturer of the venerable &quot;Digisat&quot; &lt;strong&gt;DG2PLUS&lt;/strong&gt; &amp;amp; &lt;strong&gt;DG3&lt;/strong&gt; as well as the &quot;Acutrac 22&quot; &lt;strong&gt;ACUTRAC22&lt;/strong&gt; models.&amp;nbsp; The &lt;strong&gt;AC22PRO2&lt;/strong&gt; is a upgraded model with more features and a rugged metal case.&lt;/p&gt;\r\n&lt;p&gt;You will need an optional accessory to use this meter on DTV SL3S or SL5S equiped antennas. Order our part number ASL1.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Features&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Easy to Read LCD Display \r\n&lt;li&gt;Self-Contained Rechargeable Battery \r\n&lt;li&gt;Dual Satellite Signal \r\n&lt;li&gt;Strength Measurements \r\n&lt;li&gt;Selectable Audio On-Off Tone \r\n&lt;li&gt;Measures Receiver Voltage \r\n&lt;li&gt;Measures Individual LNBF \r\n&lt;li&gt;Current Consumption \r\n&lt;li&gt;Switches 22 KHz On/Off \r\n&lt;li&gt;Adjustable LCD Contrast \r\n&lt;li&gt;Tests Coax Cable Runs \r\n&lt;li&gt;AC Charger \r\n&lt;li&gt;DC Charger \r\n&lt;li&gt;13/18 Volt Switching \r\n&lt;li&gt;Field replaceable battery \r\n&lt;li&gt;22 KHz Switching \r\n&lt;li&gt;Use this meter with: HughesNet™ Systems \r\n&lt;li&gt;Multi-Satellite Installs 101° - 110° - 119°,Dish Pro &amp;amp; Superdish \r\n&lt;li&gt;SWiM compatible &lt;/li&gt;&lt;/ul&gt;', '2012-02-19 19:15:12', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:50:15', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3988, 'post', 'satellite-signal-locator-usb-dw-plus-pvfix-2', NULL, 3484, 'Satellite Signal Locator USB DW PLUS-PVFIX-2...', '&lt;p&gt;&amp;bull; Spectrum Analyzer - Clear and easy to use&lt;br /&gt;\r\n&amp;bull; QPSK constellation diagram - Detailed&lt;br /&gt;\r\n&amp;nbsp; diagnosis of digital satellite signals&lt;br /&gt;\r\n&amp;bull; Custom Carrier - Create your own file while on&lt;br /&gt;\r\n&amp;nbsp; site and see it &amp;lsquo;lock&amp;rsquo;&lt;br /&gt;\r\n&amp;bull; Data Log - Upload your installation readings to&lt;br /&gt;\r\n&amp;nbsp; your pc&lt;br /&gt;\r\n&amp;bull; LNB / cable test - Measure for open or short&lt;br /&gt;\r\n&amp;nbsp; circuit in LNB &amp;amp; cable&lt;br /&gt;\r\n&amp;bull; Dual display for DTV 101/119 - See two&lt;br /&gt;\r\n&amp;nbsp; satellites at one time, also works with SWM&lt;br /&gt;\r\n&amp;bull; DTV SWM histogram function - Up to&lt;br /&gt;\r\n&amp;nbsp; 9 simultaneous carrier (frequency) measurements&lt;br /&gt;\r\n&amp;bull; USB Connectivity&lt;br /&gt;\r\n&amp;bull; Easy-to-Read Display with Digital Enhanced Graphics&lt;br /&gt;\r\n&amp;bull; Twice the Satellite Memory Positions&lt;br /&gt;\r\n&amp;bull; One-Touch Buttons - Easy to Use&lt;br /&gt;\r\n&amp;bull; More Battery Life - Over 2 Hours on Full Charge&lt;br /&gt;\r\n&amp;bull; Spanish Language Display Option&lt;br /&gt;\r\n&amp;bull; Recalls Last Satellite Position upon Power-up&lt;br /&gt;\r\n&amp;bull; With Digital Data Stream Identification&lt;/p&gt;', '2012-02-19 19:15:12', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:50:31', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3989, 'post', 'ppc-compression-f-connector-universal-rg11-sold-as-each', NULL, 3484, 'PPC, Compression F Connector, Universal(RG11)(Sold as Each)', '&lt;ul&gt;\r\n    &lt;li&gt;Bandwidth: 0 MHz to 3 GHz&amp;nbsp;&lt;/li&gt;\r\n    &lt;li&gt;Impedance: 75 Ohms&amp;nbsp;&lt;/li&gt;\r\n    &lt;li&gt;Return Loss: Minimum -30 dB to 3 GHz&amp;nbsp;&lt;/li&gt;\r\n    &lt;li&gt;Insertion Loss: Less than .10 dB to 3 GHz&amp;nbsp;&lt;/li&gt;\r\n    &lt;li&gt;Operating Voltage: 90 V (at 60 Hz continuous AC)&amp;nbsp;&lt;/li&gt;\r\n    &lt;li&gt;Operating Temperature: -40&amp;deg;F to +140&amp;deg;F ( -40&amp;deg;C to +60&amp;deg;C)&lt;/li&gt;\r\n    &lt;li&gt;Cable Retention: 45 lbs (20.41 kg) minimum&amp;nbsp;&lt;/li&gt;\r\n    &lt;li&gt;Meets or exceeds all SCTE Specifications&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:15:12', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:50:33', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(3990, 'post', 'ppc-compression-f-conn-universal-plenum-rg6-bag-of-50', NULL, 3484, 'PPC, Compression F Conn, Universal, Plenum(RG6)(Bag of 50)', '&lt;ul&gt;\r\n    &lt;li&gt;Universal Compression Connector can be used on all RG6 Coaxial Cables with 60%, Tri and Quad-Shield for maximum versatility.&lt;/li&gt;\r\n    &lt;li&gt;DIRECTV approved&lt;/li&gt;\r\n    &lt;li&gt;Uses the O ring as a redundant seal and is always compression sealing, regardless of torque for durability.&lt;/li&gt;\r\n    &lt;li&gt;A gas tight secondary seal connection between the nut and the post achieves ultimate protection.&lt;/li&gt;\r\n    &lt;li&gt;Large tapered compression area creates a secure, moisture tight interface at the back of the connector&lt;/li&gt;\r\n    &lt;li&gt;Three circumferential gaskets seal the body to the post creating a useful design.&lt;/li&gt;\r\n    &lt;li&gt;True 360&amp;deg; compression onto cable ensures superior RF shielding performance&lt;/li&gt;\r\n    &lt;li&gt;Incorporates an iridescent chromate finish plus UV resistant plastic to provide a reliable, environmentally sealed product.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:13', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:50:35', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
