(4006, 'post', 'connector-snap-n-seal-rg6-blue-bag-of-50', NULL, 3484, 'Connector, Snap-N-Seal - RG6, Blue (Bag of 50)', '&lt;p&gt;Thomas &amp;amp; Betts introduces the Ultimate&amp;trade; Snap-N-Seal&amp;reg; Compression Connector, the newest addition to the Snap-N-Seal&amp;reg; system. Look for the classic design of this T&amp;amp;B connector. With its user-friendly, pre-positioned and detachably coupled plastic sleeve, the Ultimate&amp;trade; Snap-N-Seal&amp;reg; Connector incorporates time-proven advantages for a reliable connection.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Features&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;One connector for 6 Series SCTE specification drop cables including 60% braid, tri-shield and quad shield.&lt;/li&gt;\r\n&lt;li&gt;To reduce assembly time and simplify installation, the plastic sleeve is pre-positioned and detachably coupled to the\r\nconnector body. &lt;/li&gt;\r\n&lt;li&gt;The plastic sleeve’s separability from the connector body\r\nfurther simplifies difficult installations.&lt;/li&gt;\r\n&lt;li&gt;True 360° compression onto cable ensures superior RF\r\nshielding performance.&lt;/li&gt;\r\n&lt;li&gt;Installation requires one-step 1/4&quot; - 1/4&quot; cable preparation.&lt;/li&gt;\r\n&lt;li&gt;Quad-sealed system prevents moisture migration.&lt;/li&gt;\r\n&lt;li&gt;Incorporates an iridescent chromate finish plus UV resistant\r\nplastic and O-rings to provide a reliable, environmentally\r\nsealed product.&lt;/li&gt;\r\n&lt;li&gt;Cable retention exceeds 40 lb. minimum as specified by\r\nthe SCTE.&lt;/li&gt;\r\n\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:20', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:51:57', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4007, 'post', 'digiair-meter-off-air-w-accessories', NULL, 3484, 'Digiair, Meter Off-Air w-Accessories.', '&lt;p&gt;&amp;bull; Easy-to-Use with Compact Design&lt;br /&gt;\r\n&amp;bull; Developed for Exact Alignment &amp;amp; Adjustment of&lt;br /&gt;\r\n&amp;nbsp; Terrestrial Antennas (OFF-AIR)&lt;br /&gt;\r\n&amp;bull; LCD display for Signal Strength in Form of&lt;br /&gt;\r\n&amp;nbsp; Thermometer Scales &amp;amp; Numbers 0-99.9&lt;br /&gt;\r\n&amp;bull; Digiair shows a single channel or six channels at&lt;br /&gt;\r\n&amp;nbsp; the same time. Can view signal in spectrum mode&lt;br /&gt;\r\n&amp;bull; Can Feed Voltage (5 Volt) to external activeamplified&lt;br /&gt;\r\n&amp;nbsp; antennas. Short-circuit protected by an automatic fuse&lt;br /&gt;\r\n&amp;bull; Charged via External DC power source of 14-20 volt&lt;br /&gt;\r\n&amp;bull; View 6 Channels at Once&lt;br /&gt;\r\n&amp;bull; Input frequency: 47-862MHz&lt;br /&gt;\r\n&amp;bull; Input Level: 25-100dBuV&lt;br /&gt;\r\n&amp;bull; Input Impedance: 75Ohm, F-Connectors&lt;br /&gt;\r\n&amp;bull; Short-Circuit Protection: Automatic fuse on antenna input&lt;br /&gt;\r\n&amp;bull; Indications: Antenna voltage 5V on/off&lt;br /&gt;\r\n&amp;bull; Power supply: External DC power supply 12-18V (Center-pin +)&lt;br /&gt;\r\n&amp;bull; Display: 128 x 64 pixels LCD&lt;br /&gt;\r\n&amp;bull; Power Consumption: Ca 230mA&lt;br /&gt;\r\n&amp;bull; Internal Battery: 600mAh, 8.4 V&lt;br /&gt;\r\n&amp;bull; Weight: 0.3 Kg - 0.66 lbs&lt;br /&gt;\r\n&amp;bull; Dimensions: 134 x 55 x 35 mm&lt;br /&gt;\r\n&amp;bull; Options: Carrying Case&lt;/p&gt;', '2012-02-19 19:15:20', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:52:03', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4008, 'post', 'coax-stripper-ripley-rg59-6-and-n48', NULL, 3484, 'Coax Stripper - Ripley RG59-6 and N48.', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;line-height: normal; margin: 0in 0in 0pt&quot;&gt;This cable preparation tool is lightweight and compact.&amp;nbsp;It allows you to prepare RG59 and RG6 cable without making any adjustments or requiring you to change out the blade cassette.&amp;nbsp;With one step, this cable preparation tool &lt;span style=&quot;color: black&quot;&gt;precisely exposes the center conductor by 5/16&amp;quot; (7.93mm) and removes the proper length of jacket at 1/4&amp;quot; (6.35mm). The high quality steel blade cassettes will perform 1,500+ cable preparations under normal use.&amp;nbsp;The blade cassettes are color-coded and marked with the cable series type for easy identification.&amp;nbsp;This tool is not intended for plenum series cable preparation.&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:15:21', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:52:08', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4009, 'post', 'ridgeloc-compression-rg6-quad-connectors-50-bag', NULL, 3484, 'Ridgeloc Compression,RG6 Quad Connectors (50 Bag)', '&lt;p&gt;&amp;bull; 50 RG6&amp;nbsp; Quad connectors per bag&lt;br /&gt;\r\n&amp;bull; High performance F-type connector&lt;br /&gt;\r\n&amp;bull; Quick, easy installation on all RG6&lt;br /&gt;\r\n&amp;nbsp; and RG6 Dual coax. &lt;br /&gt;\r\n&amp;bull; Designed for CATV, DSS and broadband installation&lt;br /&gt;\r\n&amp;bull; Precision machined body with mil spec plating.&lt;br /&gt;\r\n&amp;bull; Passed stringent moisture migration testing&lt;br /&gt;\r\n&amp;nbsp; to SCTE standards.&lt;br /&gt;\r\n&amp;bull; Dimpled Grip&lt;br /&gt;\r\n&amp;bull; Patented compression ridges lock in for a fool proof installation every&lt;br /&gt;\r\n&amp;nbsp; time.&lt;br /&gt;\r\n&amp;bull; Designed to work with any standard compression tool (21mm)&lt;/p&gt;', '2012-02-19 19:15:21', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:52:12', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4010, 'post', 'sureseal-compound-1-1-2inch-wide-x-10-ft-roll', NULL, 3484, 'SureSeal Compound  1 1-2inch Wide  x 10 FT ROLL', '&lt;p&gt;&lt;strong&gt;Mastic Adhesive Sealing Compound&lt;/strong&gt; &lt;br /&gt;\r\nHandy roll of mastic sealing material with multiple uses&lt;/p&gt;\r\n&lt;p&gt;This sealant is useful for many different jobs. Tacky black flexible mastic. Stays flexible for a long time even when exposed to sunlight. We had this compound tested for 2000 hours in a UV exposure chamber and it survived with little change in surface characteristics. In other words, its good stuff.&lt;/p&gt;\r\n&lt;p&gt;Primarily it is used under satellite antenna mounts when the securing lag screws need to be sealed from moisture penetration. That is the intended use, it can also be used to wrap around exposed low-voltage fittings and can be used to caulk around drilled holes to keep out bugs and moisture. It stays flexible for a long time and can later be removed if necessary.&lt;/p&gt;\r\n&lt;p&gt;Handy would be the word as it has many uses. Not an &amp;lsquo;adhesive&amp;rsquo;, more like a flexible caulking on a roll.&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;1 1/2&amp;quot; Wide x 10Ft Roll&lt;/li&gt;\r\n    &lt;li&gt;Flexible butyl rubber on a roll, used as a moisture sealant for lag screws&lt;/li&gt;\r\n    &lt;li&gt;Can be used as a moisture barrier to protect low-voltage connectors&lt;/li&gt;\r\n    &lt;li&gt;Flexible and durable&lt;/li&gt;\r\n    &lt;li&gt;UV resistant&lt;/li&gt;\r\n    &lt;li&gt;Tacky surfaces (we are talking REALLY tacky)&lt;/li&gt;\r\n    &lt;li&gt;Seals up drilled holes&lt;/li&gt;\r\n    &lt;li&gt;Many, many handy uses&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:21', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:52:16', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4011, 'post', 'rg6-60percent-maxpipe-catv-blk-1000-ft-reel', NULL, 3484, 'RG6 60% MaxPipe CATV BLK 1000 FT Reel', 'Cable, RG6, BCCS, Dual Shielding, PVC, CATV, Black, Reel 1000''', '2012-02-19 19:15:22', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:52:19', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4012, 'post', 'hot-shot-arm-element-14inchx2inch', NULL, 3484, 'Hot Shot Arm Element 14inchx2inch', '&lt;p&gt;&lt;strong&gt;Accessory for Hot Shot Heater blankets&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;The HotShot arm heater warms the LNBF support arm to assist in prevention of snow buildup. Snow piling up on the LNBF support arm can reduce the signal path enough to interfere with TV reception even if your dish has a HotShot heater on the reflector. We highly recommend this accessory in northern climate areas where the dish elevation angle is low to the horizon and the LNBF support arm is flat enough (horizontal) to allow snow accumulation on the support arm.&lt;/p&gt;\r\n&lt;p&gt;HotShot heaters have one accessory plug on the blanket and the HS14ARM plugs directly into the provided socket connection on you HotShot. Fits: DTV Slimline, DTV66E DishNetWork 1000, 1000.2, 1000.4&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;Connects to a HotShot heater blanket&lt;/li&gt;\r\n    &lt;li&gt;Self-adhesive&lt;/li&gt;\r\n    &lt;li&gt;Plugs directly into the &amp;lsquo;Accessory&amp;rsquo; plug of the HotShot heater blanket&lt;/li&gt;\r\n    &lt;li&gt;UV resistant&lt;/li&gt;\r\n    &lt;li&gt;Switches on/off in parallel with the HotShot heater thermostat sensor&lt;/li&gt;\r\n    &lt;li&gt;Uses the HotShot heater blanket power supply&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&lt;strong&gt;Packaging&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Boxed - includes the illustrated arm heater and installation sheet. The arm heater is the same grey color as the HotShot heaters.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Electrical&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;Nominal resistance = 36 Ohms&lt;/li&gt;\r\n    &lt;li&gt;Maximum voltage = 26VAC&lt;/li&gt;\r\n    &lt;li&gt;Power provided = 16 watts&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&lt;strong&gt;Installation Note&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;A HotShot dish heater is required to operate this device as the HS14ARM works in unison with the antenna heater blanket thermostat and is powered by the dish heater power supply. This device cannot operate independently as it has no sensor thermostat, nor does it have a power supply.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:22', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:52:30', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4013, 'post', 'rg6-tri-77percent-maxpipe-catv-blk-corrosion-res-reel-in-box', NULL, 3484, 'RG6 Tri-77% MaxPipe CATV Blk, Corrosion  Res. Reel In Box', 'Cable RG6, BCCS, Tri 77%, Corrosion Resistance/PVC, CATV, Black, Reel in Box 1000''', '2012-02-19 19:15:23', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:52:33', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
