(4015, 'post', 'ridgeloc-compression-rg6-connectors-50-jar', NULL, 3484, 'Ridgeloc Compression, RG6 Connectors (50 Jar)', '&lt;p&gt;This connector fits any standard non-plenum RG-6 75 Ohm single-foil wrap coax cable.&lt;/p&gt;\r\n&lt;p&gt;The RIDGELOC 360&amp;rsquo;s textured sleeve cylinder and the end bell capture rings prevent backing up regardless of where the end bell is located on the sleeve after compression. The coax is POSITIVELY captured by the end bell every time. Use ANY Standard compression tool with a compression length approximately 21 millimeters &amp;plusmn; and the RIDGELOC 360 always installs correctly for maximum quality and performance. The RIDGELOC 360 is suitable for indoor applications and is completely SCTE tested and weatherproof for hostile outdoor environments. Other features include a extremely rugged machined body, mil spec plating, dimpled grip and available customizable imprint on the identification band at the rear of the end bell.&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;50 RG6 connectors per&amp;nbsp;&lt;strong&gt;JAR&lt;/strong&gt;&lt;/li&gt;\r\n    &lt;li&gt;High performance F-type connector&lt;/li&gt;\r\n    &lt;li&gt;Quick, easy installation on all RG6 and RG6 Dual coax.&lt;/li&gt;\r\n    &lt;li&gt;Designed for CATV, DSS and broadband installation&lt;/li&gt;\r\n    &lt;li&gt;Precision machined body with mil spec plating&lt;/li&gt;\r\n    &lt;li&gt;Passed stringent moisture migration testing to SCTE standards.&lt;/li&gt;\r\n    &lt;li&gt;Dimpled Grip&lt;/li&gt;\r\n    &lt;li&gt;Patented compression ridges lock in for a fool proof installation every time.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:24', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:52:41', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4016, 'post', 'ridgeloc-compression-rg6-universal-connector-50-bag', NULL, 3484, 'Ridgeloc Compression, RG6 Universal Connector (50 bag)', '&lt;p&gt;This is our &amp;lsquo;Universal&amp;rsquo; fit RIDGELOC 360. Like all previous models it&amp;rsquo;s textured sleeve cylinder and the end bell capture rings prevent backing up regardless of where the end bell is located on the sleeve after compression. The coax is POSITIVELY captured by the end bell every time. Use ANY Standard compression tool with a compression length approximately 21 millimeters &amp;plusmn; and the RIDGELOC 360 always installs correctly for maximum quality and performance. The RIDGELOC 360 is suitable for indoor applications and is tested to SCTE standards and weatherproof for hostile outdoor environments. Other features include an extremely rugged machined body.&lt;/p&gt;\r\n&lt;p&gt;This universal connector fits any standard quad-shield, trishield or dual shield RG-6 75 Ohm coax cable.&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;50 RG6 Universal connectors per bag&lt;/li&gt;\r\n    &lt;li&gt;High performance F-type connector&lt;/li&gt;\r\n    &lt;li&gt;Quick, easy installation on all RG-6 coaxial cables including Dual, Tri and quad shield.&lt;/li&gt;\r\n    &lt;li&gt;Engineered from precision machined copper alloy, UV protected POM, PVC,&amp;nbsp;and rubber (&amp;quot;O&amp;quot; ring).&amp;nbsp;&lt;/li&gt;\r\n    &lt;li&gt;Designed to work with any standard compression tool.&lt;/li&gt;\r\n    &lt;li&gt;Designed for DBS, and broadband installations. Compatible with all application frequencies.&lt;/li&gt;\r\n    &lt;li&gt;End Bell cannot back up.&amp;nbsp;Locks coax cable securely and positively in place.&lt;/li&gt;\r\n    &lt;li&gt;Maximum performance with full attention to all internal design components reduces your cost.&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:15:24', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:52:48', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4017, 'post', 'coax-rg6-solid-copper-single-ground-1000-feet-dtv-white', NULL, 3484, 'Coax RG6 Solid Copper Single Ground-1000 Feet DTV White', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;This white, single, RG-6 coax cable is UL Listed, has a solid copper center conductor wire, SBCA compliant, includes a grounding wire and comes 1000&amp;rsquo; in an easy to use pull box with internal rolling reel. &lt;/span&gt;&lt;b&gt;&amp;nbsp;&lt;/b&gt;&lt;span style=&quot;color: black&quot;&gt;This cable has a PVC jacket, foamed polyethylene, foot markers every 2&amp;rsquo; for easy length cuts and is the best RG-6 cable for all of your cabling needs.&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:15:24', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:52:51', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4018, 'post', 'mount-non-penetrating-1-3-4inch-and-2inch-mast-adjustable', NULL, 3484, 'Mount, Non Penetrating 1 3-4inch and 2inch Mast-Adjustable', '&lt;p&gt;&lt;span style=&quot;line-height: 115%; font-family: Calibri; font-size: 11pt; mso-bidi-font-family: Calibri; mso-fareast-font-family: ''Times New Roman''; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA&quot;&gt;This adjustable, non-penetrating roof mount is designed for the slim line and the international dish. The mast will adjust from 1 &amp;amp; &amp;frac34;&amp;rdquo; to 2&amp;rdquo;, the installer simply selects the diameter when assembling the frame. No holes need to be drilled in the roof surface, this avoids reluctance by building owners and reduces the possibly of roof leaks. The total weight of the assembly can be varied by the use of either &amp;ldquo;light&amp;rdquo; concrete blocks or standard weight blocks. This and ALL roof mounted antenna assemblies should be tethered to the building with a flexible steel cable for maximum security.&lt;/span&gt;&lt;/p&gt;', '2012-02-19 19:15:25', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:53:00', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4019, 'post', 'intumescent-latex-firestop-sealant-10-oz-boss-814-red', NULL, 3484, 'Intumescent Latex Firestop Sealant 10 Oz (Boss 814 Red)', '&lt;p&gt;&amp;bull; Interior/exterior use on virtually any surface&lt;br /&gt;\r\n&amp;bull; Remains flexible&lt;br /&gt;\r\n&amp;bull; VOC Compliant&lt;br /&gt;\r\n&amp;bull; 10 oz tube&lt;br /&gt;\r\n&amp;bull; Excellent freeze/thaw properties&lt;br /&gt;\r\n&amp;bull; Safe to use and handle&lt;br /&gt;\r\n&amp;bull; Water clean-up&lt;br /&gt;\r\n&amp;bull; 12 month shelf life&lt;br /&gt;\r\n&amp;bull; Apply using a standard caulk gun&lt;/p&gt;', '2012-02-19 19:15:25', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:53:03', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4020, 'post', 'holland-2-way-splitter-vertical-5-2150-mhz', NULL, 3484, 'Holland, 2-Way Splitter, Vertical(5-2150 MHz)', '&lt;p&gt;&lt;font size=&quot;2&quot;&gt;3 Sigma high performance satellite passives are designed for distribution of digital satellite signals in application where signal integrity is critical.The HRS and HRvS Series splitters utilize diode protected circuitry to prevent DC backfeeding.&lt;/font&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;&lt;font size=&quot;2&quot;&gt;Wideband Operation (15 MHz to 2150 MHz)&amp;nbsp;&lt;/font&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;font size=&quot;2&quot;&gt;High Return Loss (15 dB @ 2 GHz Typical) &lt;/font&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;font size=&quot;2&quot;&gt;Frequency-Flat Response (&amp;plusmn;0.1 dB in any 24 MHz) &lt;/font&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;font size=&quot;2&quot;&gt;Flat &amp;ldquo;F&amp;rdquo; Ports with 1&amp;rdquo; Spacing&lt;/font&gt;&lt;/li&gt;\r\n    &lt;li&gt;Solder Back Case (130 dB RFI Shielding)&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:15:26', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:53:08', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4021, 'post', 'holland-4-way-splitter-vertical-5-2150-mhz', NULL, 3484, 'Holland, 4 Way Splitter, Vertical(5-2150 MHz)', '&lt;p&gt;&lt;font size=&quot;2&quot;&gt;\r\n&lt;p&gt;&lt;font size=&quot;2&quot;&gt;3 Sigma high performance satellite passives are designed for distribution of digital satellite signals in application where signal integrity is critical.The HRS and HRvS Series splitters utilize diode protected circuitry to prevent DC backfeeding.&lt;/font&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;&lt;font size=&quot;2&quot;&gt;Wideband Operation (15 MHz to 2150 MHz)&amp;nbsp;&lt;/font&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;font size=&quot;2&quot;&gt;High Return Loss (15 dB @ 2 GHz Typical) &lt;/font&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;font size=&quot;2&quot;&gt;Frequency-Flat Response (&amp;plusmn;0.1 dB in any 24 MHz) &lt;/font&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;font size=&quot;2&quot;&gt;Flat &amp;ldquo;F&amp;rdquo; Ports with 1&amp;rdquo; Spacing&lt;/font&gt;&lt;/li&gt;\r\n    &lt;li&gt;Solder Back Case (130 dB RFI Shielding)&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;/font&gt;&lt;/p&gt;', '2012-02-19 19:15:26', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:53:12', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4022, 'post', 'holland-8-way-splitter-vertical-5-2150-mhz', NULL, 3484, 'Holland, 8-Way Splitter, Vertical(5-2150 MHz)', '&lt;p&gt;&lt;font size=&quot;2&quot;&gt;3 Sigma high performance satellite passives are designed for distribution of digital satellite signals in application where signal integrity is critical.The HRS and HRvS Series splitters utilize diode protected circuitry to prevent DC backfeeding.&lt;/font&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;&lt;font size=&quot;2&quot;&gt;Wideband Operation (15 MHz to 2150 MHz)&amp;nbsp;&lt;/font&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;font size=&quot;2&quot;&gt;High Return Loss (15 dB @ 2 GHz Typical) &lt;/font&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;font size=&quot;2&quot;&gt;Frequency-Flat Response (&amp;plusmn;0.1 dB in any 24 MHz) &lt;/font&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;font size=&quot;2&quot;&gt;Flat &amp;ldquo;F&amp;rdquo; Ports with 1&amp;rdquo; Spacing&lt;/font&gt;&lt;/li&gt;\r\n    &lt;li&gt;Solder Back Case (130 dB RFI Shielding)&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:15:27', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:53:16', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4023, 'post', 'hot-shot-retrofit-kit-18inch-dish-full-size', NULL, 3484, 'Hot Shot Retrofit Kit, 18inch Dish - Full Size', '&lt;p&gt;&lt;strong&gt;Fits:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;3LNB DTV (1820 Dish) *18&amp;rdquo; DTV (18DISH) * Fits Front or Back of 18&amp;rdquo; DishNetWork 1000 DishNetWork 500&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;Safe low-voltage 24 VAC heater&lt;/li&gt;\r\n    &lt;li&gt;Does not require hiring a licensed electrician for installation&lt;/li&gt;\r\n    &lt;li&gt;Automatic thermostat turns ''on'' just above freezing temperatures and ''off'' when the dish surface warms up&lt;/li&gt;\r\n    &lt;li&gt;Durable Vinyl material lasts a long time&lt;/li&gt;\r\n    &lt;li&gt;Etched foil resistance heating element&lt;/li&gt;\r\n    &lt;li&gt;Multiple heat zones apply the maximum heat where it''s needed most&lt;/li&gt;\r\n    &lt;li&gt;3M Acrylic adhesive assures a tight bond to the antenna&lt;/li&gt;\r\n    &lt;li&gt;Conforms to the reflector curves and angles&lt;/li&gt;\r\n    &lt;li&gt;One hundred feet of &lt;span style=&quot;line-height: 115%; font-family: &amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;; font-size: 9pt; mso-fareast-font-family: ''Times New Roman''; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA&quot;&gt;electrical&lt;/span&gt; cable provided&lt;/li&gt;\r\n    &lt;li&gt;Heavy-duty wire-wound power transformer provided&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:27', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:53:28', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL);
