(4024, 'post', 'hot-shot-universal-peel-and-stick-heater-kit', NULL, 3484, 'Hot Shot Universal Peel and Stick Heater Kit', '&lt;p&gt;&lt;strong&gt;Fits:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Slimline AU9 5LNB DTV, AT9 5LNB DTV, DTV66E (International), .74Raven (Steel) HNet, .74 Prodelin (Steel) Hnet&lt;/p&gt;\r\n&lt;p&gt;*Blanket fits on Front or Back of Slimline and .74 Prodelin Steel&lt;/p&gt;\r\n&lt;p&gt;Blanket Size: (28&amp;rdquo; X 20&amp;rdquo;)&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;&lt;span style=&quot;font-size: 9pt&quot;&gt;Safe low-voltage 24 VAC heater&lt;/span&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;span style=&quot;font-size: 9pt&quot;&gt;Does not require hiring a licensed electrician for installation&lt;/span&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;span style=&quot;font-size: 9pt&quot;&gt;Automatic thermostat turns ''on'' just above freezing temperatures and ''off'' when the dish surface warms up&lt;/span&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;span style=&quot;font-size: 9pt&quot;&gt;Durable Vinyl material lasts a long time&lt;/span&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;span style=&quot;font-size: 9pt&quot;&gt;Etched foil resistance heating element&lt;/span&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;span style=&quot;font-size: 9pt&quot;&gt;Multiple heat zones apply the maximum heat where it''s needed most&lt;/span&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;span style=&quot;font-size: 9pt&quot;&gt;3M Acrylic adhesive assures a tight bond to the antenna&lt;/span&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;span style=&quot;font-size: 9pt&quot;&gt;Conforms to the reflector curves and angles&lt;/span&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;span style=&quot;font-size: 9pt&quot;&gt;One hundred feet of electrical cable provided&lt;/span&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;span style=&quot;font-size: 9pt&quot;&gt;Heavy-duty wire-wound power transformer provided&lt;/span&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:27', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:53:33', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4025, 'post', 'mount-non-penetrating-with-multiple-foot', NULL, 3484, 'Mount, Non Penetrating with Multiple Foot', '&lt;p&gt;A variety of hole patterns are pre-punched in this base frame. You can drill the center plate area if necessary to fit other antenna foot patterns.&amp;nbsp; No holes need to be drilled in the roof surface, this avoids reluctance by building owners and reduces the possibility of roof leaks. The total weight of the assembly can be varied by the use of either &amp;ldquo;light&amp;rdquo; concrete blocks or standard weight blocks. Of course, this and ALL roof mounted antenna assemblies should be tethered to the building with a flexible steel cable for maximum security.&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;Fits SLP-F, 18DISH, 1820DISH, DISH 500, 1,000.2, 1,000.4 and DTV66E series antennas. Also fits most 18&amp;rdquo; &amp;amp; 24&amp;rdquo; oval dishes.&lt;/li&gt;\r\n    &lt;li&gt;Drill custom clearance holes for any other small dish foot pattern.&lt;/li&gt;\r\n    &lt;li&gt;Wind leg attachment holes provided in two different directions for maximum stability&lt;/li&gt;\r\n    &lt;li&gt;Grey powder coated steel construction&lt;/li&gt;\r\n    &lt;li&gt;1.50&amp;rdquo; angle steel frame Holds Eight concrete blocks for ballast&lt;/li&gt;\r\n    &lt;li&gt;No roof drilling or roof penetration required&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:27', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:53:40', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4026, 'post', 'ladder-32-frp-ext-type-ia-300-lb-rating', NULL, 3484, 'Ladder, 32'' FRP EXT, Type IA, 300 lb. Rating', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 0pt 0.5in; text-indent: -0.25in; line-height: normal&quot;&gt;&lt;span style=&quot;font-size: 10pt; color: black&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; color: black&quot;&gt;The pre-pierced holes of this ladder make for easy and convenient field installation.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;margin: 0in 0in 0pt 0.5in; text-indent: -0.25in; line-height: normal&quot;&gt;&lt;span style=&quot;font-size: 10pt; color: black&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; color: black&quot;&gt;Internal guides at the bottom of the fly section offer secure interlocking of the fiberglass rails for protection and sturdiness.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;margin: 0in 0in 0pt 0.5in; text-indent: -0.25in; line-height: normal&quot;&gt;&lt;span style=&quot;font-size: 10pt; color: black&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; color: black&quot;&gt;Aluminum construction and a traction-tred feature keeps the rungs durable while ensuring a secure footing, while the rail shield bracket and shoe-lock feature to resist slipping for ultimate security.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;margin: 0in 0in 0pt 0.5in; text-indent: -0.25in; line-height: normal&quot;&gt;&lt;span style=&quot;font-size: 10pt; color: black&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; color: black&quot;&gt;The base and fly sections are easily separated to use the base as a single ladder for maximum effectiveness.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt 0.5in; text-indent: -0.25in; line-height: normal&quot;&gt;&lt;span style=&quot;font-size: 10pt; color: black&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; color: black&quot;&gt;Alflo rung joint connections prevent twisting, the molded end caps protect work surfaces from damage, and the heavy-duty pulley with rope makes height adjustment easier.&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:15:28', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:53:42', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4027, 'post', 'roof-mat-for-npr-mount-37-9inch-x-35-375inch-fits-npr6-and-npr8', NULL, 3484, 'Roof Mat for NPR Mount, 37.9inch x 35.375inch(Fits NPR6 and NPR8)', '&lt;p&gt;These pads are designed to be used under non-penetrating roof\r\n(NPR) mounts like our NPR6B and NPR8 . No holes need to be drilled in the roof surface with those mount designs but a pad should be used under the frame to provide a small buffer between the metal angle and the roof coating.&lt;/p&gt;\r\n&lt;p&gt;Use of a pad can avoid reluctance by building owners and reduce the possibly of roof leaks.&lt;/p&gt;\r\n&lt;p&gt;Of course, this and ALL flat-roof NPR antenna assemblies should be tethered to the building with a flexible steel cable for maximum security. We highly suggest that you install our PVTK1 tether kit for maximum retention of the dish and mount in high wind conditions.&lt;/p&gt; \r\n&lt;p&gt;Be safe and show consideration, its much more professional to use both a roof pad and a tether kit! &lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n&lt;li&gt;Roof Pad gives your job a\r\nprofessional look&lt;/li&gt;\r\n&lt;li&gt;Textured pebble-grain\r\nsurface, not just a piece\r\nof used conveyor belt&lt;/li&gt;\r\n&lt;li&gt;Tough pad helps avoid\r\ncutting or imprinting the\r\nroof surface&lt;/li&gt;\r\n&lt;li&gt;Pad Thickness ~ 0.130&quot;&lt;/li&gt;\r\n&lt;li&gt;Reduce reluctance of\r\nbuilding owners&lt;/li&gt;\r\n\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:28', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:53:46', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4028, 'post', 'hughesnet-hn9000-modem-new-or-reconditioned', NULL, 3484, 'HughesNet, HN9000 Modem (New or Reconditioned)', '&lt;p&gt;The HughesNet HN9000 is the next-generation of satellite technology from HUGHES&amp;trade; refined and optimized to be the most bandwidth-efficient modem that HUGHES has ever produced!!!&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;HughesNet HN9000 Modem Advantages:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul style=&quot;text-align: left&quot; class=&quot;list_new2&quot;&gt;\r\n    &lt;li&gt;Software and configuration updates via download from the HughesNet ''s Network Operation center (NOC)&lt;/li&gt;\r\n    &lt;li&gt;Implements Performance Enhancement Proxy (PEP) software to accelerate throughput performance by optimizing the TCP transmission over the satellite, delivering superior user experience and link efficiency&lt;/li&gt;\r\n    &lt;li&gt;Implements TurboPage software to accelerate HTTP traffic for fast browser access&lt;/li&gt;\r\n    &lt;li&gt;Quality of Service features include: IQoS (Inbound Quality of Service), bidirectional DSCP, and outbound bandwidth management&lt;/li&gt;\r\n    &lt;li&gt;Supports HughesNet VPN Accelerator&lt;/li&gt;\r\n    &lt;li&gt;Bi-directional data compression&lt;/li&gt;\r\n    &lt;li&gt;Configuration, status monitoring, and commissioning via the NOC&lt;/li&gt;\r\n    &lt;li&gt;Acts as a local router providing:&lt;/li&gt;\r\n    &lt;li&gt;Static and dynamic addressing&lt;/li&gt;\r\n    &lt;li&gt;DHCP server or relay&lt;/li&gt;\r\n    &lt;li&gt;DNS caching&lt;/li&gt;\r\n    &lt;li&gt;Full RIPV2 routing support&lt;/li&gt;\r\n    &lt;li&gt;Multicasts to the LAN by using IGMP&lt;/li&gt;\r\n    &lt;li&gt;NAT/PAT&lt;/li&gt;\r\n    &lt;li&gt;VLAN tagging&lt;/li&gt;\r\n    &lt;li&gt;Firewall support through integrated access control lists&lt;/li&gt;\r\n    &lt;li&gt;User friendly LED display indicating terminal operational status&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:28', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:53:48', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4029, 'post', '5-16x2inch-grade-5-lag-bolt-bag-50-uses-1-2inch-socket', NULL, 3484, '5-16x2inch, Grade 5 Lag Bolt. Bag-50 (uses 1-2inch socket)', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;&lt;span&gt;These are general purpose hex head lag screws are 5/16&amp;rdquo; x 2&amp;rdquo;.&amp;nbsp;They are made of zinc plated grade #5 steel.&amp;nbsp;The hex head requires a &amp;frac12;&amp;rdquo; drive socket or wrench.&amp;nbsp;Hardwoods should be pre-drilled with a pilot hole.&amp;nbsp;Packed 50 pieces per bag.&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:15:29', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:53:54', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4030, 'post', 'perfect-vision-silicone-sealant-3-oz-clear', NULL, 3484, 'Perfect Vision Silicone Sealant 3 Oz, Clear', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;This is a &amp;ldquo;RTV&amp;rdquo; (Room Temperature Vulcanization) product which is typically used to seal voids where moisture or insects could enter dwellings or structures. It sets up to form a semi-clear pliable filler. It is ideal for sealing around screw holes, drilled access holes for coax and other similar small void areas where a pliable gasket type seal would be prudent. This compound contains acidic compounds and should NOT be used in or on electrical connections or near electrical components or circuit boards.&lt;/div&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;Insulates thermally&amp;nbsp;&lt;span style=&quot;display: none&quot; id=&quot;1311879860533S&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/li&gt;\r\n    &lt;li&gt;Waterproof seal&lt;/li&gt;\r\n    &lt;li&gt;Weatherproof seal&lt;/li&gt;\r\n    &lt;li&gt;Permanently flexible -60&amp;deg;F to 450&amp;deg;F&lt;/li&gt;\r\n    &lt;li&gt;Insulates electrically&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:29', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:53:59', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4031, 'post', 'directv-ir-remote-control-w-no-batteries-universal', NULL, 3484, 'DirecTV, IR Remote Control w-No Batteries, Universal', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;line-height: normal; margin: 0in 0in 8.2pt&quot;&gt;This exclusive DIRECTV&amp;reg; universal remote control will control four components, including a DIRECTV receiver, a television, and two stereo or video components (for example, a DVD player, a stereo, or a second television).&amp;nbsp;It is designed to operate all of the features of the DIRECTV receiver. It has an extensive universal library code which ensures compatibility with most audio and video devices.&amp;nbsp;&lt;span style=&quot;color: #1b1b1b&quot;&gt;The four-position MODE slide switch is great for easy component selection and code search to help you program the controller of older or discontinued components. It includes a guide, list, channel and mute functions.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 8.2pt 38.2pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;It controls up to 4 components, including a DIRECTV receiver.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 8.2pt 38.2pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;It has a very large library code for popular video and stereo components.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 8.2pt 38.2pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7pt ''Times New Roman''&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: #1b1b1b&quot;&gt;Memory protection to secure against re-programming during battery replacement is included&lt;/span&gt;&lt;span style=&quot;color: black&quot;&gt;.&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:15:30', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:54:01', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4032, 'post', 'ridgeloc-compression-rg6-universal-connector-50-bag-20120219155412', NULL, 3484, 'Ridgeloc Compression, RG6 Universal Connector (50 bag)', '&lt;p&gt;This universal connector fits any standard quad-shield, trishield or dual shield RG-6 75 Ohm coax cable.&lt;/p&gt;\r\n&lt;p&gt;This is our &amp;lsquo;Universal&amp;rsquo; fit RIDGELOC 360. Like all previous models it&amp;rsquo;s textured sleeve cylinder and the end bell capture rings prevent backing up regardless of where the end bell is located on the sleeve after compression. The coax is POSITIVELY captured by the end bell every time. Use ANY Standard compression tool with a compression length approximately 21 millimeters &amp;plusmn; and the RIDGELOC 360 always installs correctly for maximum quality and performance. The RIDGELOC 360 is suitable for indoor applications and is completely SCTE tested and weatherproof for hostile outdoor environments. Other features include a extremely rugged machined body, mil spec plating, dimpled grip and available customizable imprint on the identification band at the rear of the end bell.&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;50 RG6 Universal connectors per bag&lt;/li&gt;\r\n    &lt;li&gt;High performance F-type connector&lt;/li&gt;\r\n    &lt;li&gt;Quick, easy installation on all RG-6 coaxial cables including Dual, Tri and quad shield.&lt;/li&gt;\r\n    &lt;li&gt;Precision machined body with mil spec plating.&lt;/li&gt;\r\n    &lt;li&gt;Dimpled Grip&lt;/li&gt;\r\n    &lt;li&gt;Designed to work with any standard compression tool.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:30', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:54:12', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4033, 'post', 'foxcom-compact-5l-band-rx-w-built-in-cwdm-200-2500-mhz', NULL, 3484, 'Foxcom, Compact 5L-Band RX w-Built In CWDM(200-2500 MHz)', '\r\n&lt;p style=&quot;MARGIN: 0in 0in 10pt&quot; class=MsoNormal&gt;&lt;font face=Calibri&gt;&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;This compact, 200 MHz-2,500 MHz receiver with a built in CWDM is a very cost effective optical-to-coax converter for five L-Band (SAT-IF) polarities, cable TV and digital terrestrial signals. The compact housing is specifically designed for deployments where space is at a premium. It’s small footprint, low power consumption and high output power can serve multiple homes from a single receiver, making it the ideal solution for both small and medium deployments. This receiver is a &quot;plug and play&quot; product without the need for any manual adjustments making installations quick and easy.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span class=producttextbody&gt;&lt;span style=&quot;FONT-FAMILY: Calibri; COLOR: black&quot;&gt;DIRECTV&lt;/span&gt;&lt;/span&gt;&lt;span class=producttextbody&gt;&lt;span style=&quot;FONT-FAMILY: Calibri; COLOR: black; mso-bidi-font-family: Calibri&quot;&gt;™&lt;/span&gt;&lt;/span&gt; approved.&lt;span style=&quot;mso-bidi-font-family: Calibri&quot;&gt;&lt;?xml:namespace prefix = o ns = &quot;urn:schemas-microsoft-com:office:office&quot; /&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '2012-02-19 19:15:31', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:54:15', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4034, 'post', 'sureseal-compound-6-1-2inch-wide-x-10-ft-roll', NULL, 3484, 'SureSeal Compound 6 1-2inch Wide x 10 FT ROLL', '&lt;p&gt;This sealant is useful for many different jobs. Tacky black flexible\r\nmastic. Stays flexible for a long time even when exposed to sunlight.\r\nWe had this compound tested for 2000 hours in a UV exposure\r\nchamber and it survived with little change in surface characteristics.\r\nIn other words, its good stuff.&lt;/p&gt;\r\n\r\n&lt;p&gt;Primarily it is used under satellite antenna mounts when the securing\r\nlag screws need to be sealed from moisture penetration. That is the\r\nintended use, it can also be used to wrap around exposed low-voltage\r\nfittings and can be used to caulk around drilled holes to keep out bugs\r\nand moisture. It stays flexible for a long time and can later be removed\r\nif necessary.&lt;/p&gt;\r\n\r\n&lt;p&gt;Handy would be the word as it has many uses. Not an ‘adhesive’,\r\nmore like a flexible caulking on a roll.&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n&lt;li&gt;Flexible butyl rubber on a\r\nroll, used as a moisture\r\nsealant for lag screws&lt;/li&gt;\r\n&lt;li&gt;Can be used as a\r\nmoisture barrier to\r\nprotect low-voltage\r\nconnectors&lt;/li&gt;\r\n&lt;li&gt;Flexible and durable&lt;/li&gt;\r\n&lt;li&gt;UV resistant&lt;/li&gt;\r\n&lt;li&gt;Tacky surfaces (we are\r\ntalking REALLY tacky)\r\n&lt;/li&gt;\r\n&lt;li&gt;Seals up drilled holes&lt;/li&gt;\r\n&lt;li&gt;Many, many handy uses&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:31', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:54:18', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4035, 'post', 'tripod-3-foot-accepts-up-to-2inch-od-pole-pole-not-included', NULL, 3484, 'Tripod, 3 foot accepts up to 2inch OD Pole (pole not included)', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;This tripod tower is very sturdy and has multiple uses. It can be used as support for off-air VHF/UHF antennas and it can be used as support for satellite antennas. The tripod can be permanently bolted to building surfaces or concrete with the proper anchor bolts.&amp;nbsp;The tripod collapses to a bundle that can be stored in a RV or even carried in passenger vehicles.&amp;nbsp;We highly recommend that a sealing material is used under the feet if the tripod is mounted on a roof surface. We suggest that you use our EZP10, PV2626, PV2632 or some similar flexible sealing pad material that will prevent roof leaks. Tripods are not suggested for Ka satellite antennas.&lt;/div&gt;', '2012-02-19 19:15:31', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:54:24', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4036, 'post', 'perfect-vision-12inch-under-window-jumper', NULL, 3484, 'Perfect Vision, 12inch Under Window Jumper', '&lt;ul&gt;\r\n    &lt;li&gt;True Coaxial Cable: 18 dB return loss @ 2150 MHz&lt;/li&gt;\r\n    &lt;li&gt;Electrical specs do not degrade with bending, impact or temp&lt;/li&gt;\r\n    &lt;li&gt;Higher Connector-Cable Holding Force: Greater than 60 lbs&lt;/li&gt;\r\n    &lt;li&gt;Thinner Cable: Less than 3mm&lt;/li&gt;\r\n    &lt;li&gt;High Center Conductor Holding F Connectors: Greater than 150g&lt;/li&gt;\r\n    &lt;li&gt;Impact Durability: 50,000 impacts(with no electrical degradation)&lt;/li&gt;\r\n    &lt;li&gt;Shape Retention: Employs a metal structure to hold sharper bends&lt;/li&gt;\r\n    &lt;li&gt;Weather Seals: Included on outdoor connector for moisture protection&lt;/li&gt;\r\n    &lt;li&gt;Meets All SCTE Requirements&lt;/li&gt;\r\n    &lt;li&gt;DirecTV Approved&lt;/li&gt;\r\n    &lt;li&gt;UL Listed&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:15:32', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:54:28', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4037, 'post', 'rca-antenna-indoor-omni-directional-flat-amp-hd-blk-large', NULL, 3484, 'RCA,Antenna,Indoor,Omni-Directional,Flat,Amp,HD(BLK)(Large)', '&lt;ul&gt;\r\n    &lt;li&gt;High Gloss Black Finish&lt;/li&gt;\r\n    &lt;li&gt;Antenna is paintable&lt;/li&gt;\r\n    &lt;li&gt;Supports 1080 resolution reception&lt;/li&gt;\r\n    &lt;li&gt;Amplify weak signals with removable amplifier&lt;/li&gt;\r\n    &lt;li&gt;Outperforms traditional antennas due to patented design&lt;/li&gt;\r\n    &lt;li&gt;Perserves signal purity with extremely low noise circuitry&lt;/li&gt;\r\n    &lt;li&gt;Eliminate constant adjustments&lt;/li&gt;\r\n    &lt;li&gt;Slim profile disappears into surrondings&lt;/li&gt;\r\n    &lt;li&gt;Designed for DTV&lt;/li&gt;\r\n    &lt;li&gt;Receives local HD and all digital TV broadcasts&lt;/li&gt;\r\n    &lt;li&gt;Coax cable is built in&lt;/li&gt;\r\n    &lt;li&gt;Includes easel stand&lt;/li&gt;\r\n    &lt;li&gt;One year limited warranty&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:15:32', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:54:33', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4038, 'post', 'coax-rg6-solid-copper-single-1000-feet-dtv-black', NULL, 3484, 'Coax RG6 Solid Copper- Single 1000 Feet DTV Black.', '&lt;p&gt;&lt;span style=&quot;line-height: 115%; font-family: Calibri; font-size: 11pt; mso-bidi-font-family: Calibri; mso-fareast-font-family: ''Times New Roman''; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA&quot;&gt;This black, single, RG-6 coax cable is UL Listed, has a solid copper conductor wire, DIRECTV approved, SBCA compliant, and comes in an easy to use 1000&amp;rsquo; pull box with internal rolling reel. This cable is HD approved, has a PVC jacket, foamed polyethylene, foot markings for easy length cuts and is the best RG-6 cable for all of your cabling needs.&lt;/span&gt;&lt;/p&gt;', '2012-02-19 19:15:33', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:54:36', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4040, 'post', 'coax-rg6-solid-copper-dual-ground-500-feet-dtv-white', NULL, 3484, 'Coax RG6 Solid Copper Dual Ground - 500 Feet DTV White', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;This white, dual, RG-6 coax cable is UL Listed, has a solid copper conductor wire, SBCA compliant, includes a grounding wire and comes in an easy to use 500&amp;rsquo; pull box with internal rolling reel. This cable is HD approved, has a PVC jacket, foamed polyethylene, foot markers every 2&amp;rsquo; for easy length cuts and is the best RG-6 cable for all of your cabling needs.&lt;/div&gt;', '2012-02-19 19:15:33', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:54:50', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4041, 'post', 'coax-rg6-solid-copper-single-ground-1000-feet-dtv-black-20120219155453', NULL, 3484, 'Coax RG6 Solid Copper Single Ground-1000 Feet DTV Black', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 9pt 9pt 5pt 0in&quot;&gt;&lt;span style=&quot;font-size: 11pt&quot;&gt;This black, single, RG-6 coax cable is UL Listed, has a solid copper conductor wire, SBCA compliant, includes a grounding wire and comes in an easy to use 1000&amp;rsquo; pull box with internal rolling reel.&amp;nbsp;It is swept tested to 3 GHz, 60% aluminum braiding, 100% shielded, PVC jacket and foamed polyethylene.&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:15:34', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:54:53', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4042, 'post', 'coax-rg6-solid-copper-single-ground-1000-feet-dtv-white-20120219155458', NULL, 3484, 'Coax RG6 Solid Copper Single Ground-1000 Feet DTV White', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;This white, single, RG-6 coax cable is UL Listed, has a solid copper center conductor wire, DIRECTV approved, SBCA compliant, includes a grounding wire and comes in an easy to use 1000&amp;rsquo; pull box with internal rolling reel. &lt;b&gt;&lt;span style=&quot;color: #003366&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;This cable has a PVC jacket, foamed polyethylene, foot markers every 2&amp;rsquo; for easy length cuts and is the best RG-6 cable for all of your cabling needs.&lt;/div&gt;', '2012-02-19 19:15:34', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:54:58', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4043, 'post', 'holland-dish-approved-12inch-under-window-jumper', NULL, 3484, 'Holland, DISH Approved 12inch Under Window Jumper', '&lt;ul&gt;\r\n    &lt;li&gt;True Coaxial Cable: 18dB Return Loss @ 2150MHz&lt;/li&gt;\r\n    &lt;li&gt;Electrical Specs Do Not Degrade With Bending, Impact or Temp&lt;/li&gt;\r\n    &lt;li&gt;Higher Connector-Cable Holding Force: Greater than 60 lbs&lt;/li&gt;\r\n    &lt;li&gt;Thinner Cable: Less than 3mm&lt;/li&gt;\r\n    &lt;li&gt;High Center Conductor Holding F Connectors: Greater than 150g&lt;/li&gt;\r\n    &lt;li&gt;Impact Durability: 50,000 impacts(with no electrical degradation)&lt;/li&gt;\r\n    &lt;li&gt;Shape Retention: Employs a Metal Structure to Hold Sharper Bends&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:15:34', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:55:06', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4044, 'post', 'ground-block-scte-single-with-ws', NULL, 3484, 'Ground Block, SCTE Single with WS', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;line-height: normal; margin: 0in 0in 10pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;The internal components of this single ground blocks are much different from a standard frequency VHF/UHF ground block. The center coax conductor indexes into a close-tolerance tube that is resilient (spring) brass and is gold plated. The close center-tube tolerance assures a tight connection, the gold plating assures a good electrical connection and the overall performance is greatly improved over standard designs. DIRECTV approved.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; SCTE Outdoor Compliant bonding block.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Rated for 0 MHz to 3 GHz.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; One inch spacing between centers of ports.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; UV resistant rubber weather seals provided.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; UL approved.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Internal components designed for high frequency and low loss.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Gold plated center conductor assures good connections.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Resilient internal metals for dependable repeated insertion connections.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 0pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Minimal insertion and return loss numbers.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;line-height: normal; text-indent: -0.25in; margin: 0in 0in 10pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Two mounting screws are provided with each block.&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:15:35', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:55:21', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4045, 'post', 'conn-barrel-outdoor-100-pc-bag-3ghz-high-freq-ws', NULL, 3484, 'Conn, Barrel Outdoor, 100 pc bag 3GHZ-High Freq, WS', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;This in-line spice connector is much different than the standard VHF/UHF connector because the internal components are designed for high frequencies.&amp;nbsp;The center coax conductor indexes into a close-tolerance tube that is resilient (spring) brass and is gold plated. The close center-tube tolerance assures a tight connection, the gold plating assures a good electrical connection and the overall performance is greatly improved over standard designs. Internally, the center conductor tube is insulated from the inner skin of the barrel by a maximum air gap which results in much less RF loss. Insertion loss is extremely low and not really necessary to consider in complex systems. It is rated for 0 MHz to 3 GHz. This in-line spice connector is intended for outdoor use. Rubber weather seals on each side provide an added layer of moisture resistance.&amp;nbsp;DIRECTV approved.&lt;/div&gt;', '2012-02-19 19:15:35', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:55:30', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4046, 'post', 'winegard-30-inch-dish-d-tube-feed-20120219155659', NULL, 3484, 'Winegard, 30 Inch Dish(D Tube Feed)', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;&lt;span&gt;This 30&amp;rdquo; satellite receiving antenna dish system utilizes a D-tube feed support.&amp;nbsp;This dish is designed using the CAD-CAM process.&amp;nbsp;Galvanized steel, used in the manufacturing process, is carbon sheet steel with a zinc-iron alloy coating.&amp;nbsp;Corrosion resistant, these alloys react to scratches and other damage through galvanic action between steel and zinc &amp;ndash; the zinc protects breaks in the coating and prevents further damage after installation.&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:15:36', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:56:59', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4047, 'post', 'ground-clamp-2-piece-fits-1-2-1-ul-20120219155710', NULL, 3484, 'Ground Clamp, 2 piece fits 1-2- 1(UL)', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;This two piece ground clamp fits pipers between &amp;frac12;&amp;rdquo; and 1&amp;rdquo;.&amp;nbsp;It is UL/CUL Listed.&amp;nbsp;The two jaws (clamps) are made of copper alloy and the bolts have slotted round heads and are made of zinc plated steel.&amp;nbsp;Use in conjunction with other grounding supplies to protect against lightning strikes and power surges.&lt;/div&gt;', '2012-02-19 19:15:36', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:57:10', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4048, 'post', 'universal-linear-compression-tool-deluxe', NULL, 3484, 'Universal Linear Compression Tool Deluxe', '&lt;p&gt;&amp;bull; Works with Connector Models&lt;br /&gt;\r\n&amp;nbsp; &amp;bull; Ridgeloc 360&lt;br /&gt;\r\n&amp;nbsp; &amp;bull; PPC- EX6XL &amp;amp; CMP Series&lt;br /&gt;\r\n&amp;nbsp; &amp;bull; Digicon- DS Series&lt;br /&gt;\r\n&amp;nbsp; &amp;bull; Corning Gilbert-Ultra Ease Series&lt;br /&gt;\r\n&amp;nbsp; &amp;bull; Snap &amp;lsquo;n Seal- SNS Series&lt;br /&gt;\r\n&amp;bull; Heavy Duty Frame&lt;br /&gt;\r\n&amp;bull; Ratcheting Design&lt;/p&gt;', '2012-02-19 19:15:37', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:57:42', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4049, 'post', 'cable-flex-clips-single-screw-1-2inch-depth-blk-bag-100', NULL, 3484, 'Cable Flex Clips, Single, screw, 1-2inch depth, Blk, Bag-100', '&lt;p&gt;&amp;bull; Superior design avoids stress on the cable &amp;amp; stress on the clip&lt;br /&gt;\r\n&amp;bull; Integrity of signal is unimpeded &amp;amp; life of&lt;br /&gt;\r\n&amp;nbsp; clip is virtually unmatched&lt;br /&gt;\r\n&amp;bull; Manufactured from a pliable, durable polyethylene&lt;br /&gt;\r\n&amp;bull; Wraps around cable without exerting&lt;br /&gt;\r\n&amp;nbsp; pressure on coax&lt;br /&gt;\r\n&amp;bull; Adjustable teeth&lt;br /&gt;\r\n&amp;bull; Each clip can accommodate additional&lt;br /&gt;\r\n&amp;nbsp; ground or messenger wire&lt;br /&gt;\r\n&amp;bull; Screws eliminate chance of accidental damage from tools&lt;br /&gt;\r\n&amp;bull; Designed for ground wire--penetrates&lt;br /&gt;\r\n&amp;nbsp; the surface 1/2&amp;rdquo; &lt;br /&gt;\r\n&amp;bull; Holds single cable&lt;br /&gt;\r\n&amp;bull; Black in color&lt;br /&gt;\r\n&amp;bull; Bag of 100&lt;/p&gt;', '2012-02-19 19:15:37', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:58:16', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4050, 'post', '6-split-bolt-ul-approved', NULL, 3484, '#6 Split Bolt- UL Approved', '&lt;ul&gt;\r\n    &lt;li&gt;Use this split bolt to join two or more ground wires together like a splice&lt;/li&gt;\r\n    &lt;li&gt;The nut is backed off, insert wires under the head of bolt &amp;amp; tighten nut&lt;/li&gt;\r\n    &lt;li&gt;The nut forces a sliding center T-shaped anvil up against the two wires &amp;amp; crushes&amp;nbsp; them against the underside of the bolt head.&lt;/li&gt;\r\n    &lt;li&gt;UL Approved&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:15:37', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:58:20', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4051, 'post', '8-split-bolt-ul-approved', NULL, 3484, '#8 Split Bolt- UL Approved', '&lt;ul&gt;\r\n    &lt;li&gt;Use this split bolt to join two or more ground wires together like a splice&lt;/li&gt;\r\n    &lt;li&gt;The nut is backed off, insert wires under the head of bolt &amp;amp; tighten nut&lt;/li&gt;\r\n    &lt;li&gt;The nut forces a sliding center T-shaped anvil up against the two wires &amp;amp; crushes&amp;nbsp; them against the underside of the bolt head.&lt;/li&gt;\r\n    &lt;li&gt;UL Approved&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:15:38', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:58:24', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4052, 'post', 'winegard-hd-antenna-300-ohm-11-vhf-14-uhf-elements-7-69', NULL, 3484, 'Winegard, HD Antenna(300 Ohm - 11 VHF,14 UHF Elements)(7-69)', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 0pt; line-height: normal&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;&amp;bull; Boosts gain 2 to 3 times more than standard bow-tie antennas on VHF high band for superior performance.&lt;br /&gt;\r\n&amp;bull;&amp;nbsp;Wide beam width allows the HD-1080 to lock in on broadcast TV towers close together or spaced far apart for complete programming reception&lt;br /&gt;\r\n&amp;bull; Hi Vhf/Uhf Antenna is optimized for Channels 7-69 with a signal range of 0-40 miles for maximum capability&lt;br /&gt;\r\n&amp;bull; Compact vertical design for versatile (DIRECTV) installation.&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:15:38', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:58:27', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
