(4056, 'post', 'black-rg6-cable-1000-ft-reel-box-ft4-cmr', NULL, 3484, 'Black, RG6 Cable 1000 ft Reel-Box, FT4-CMR', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;This black, single, RG6 coax cable has a copper clad steel center conductor, is UL approved and comes 1000&amp;rsquo; in an easy to use pull box with internal rolling reel.&amp;nbsp;&lt;span style=&quot;color: black&quot;&gt;This cable has a UV resistant PVC jacket, foamed polyethylene, footage markers every two feet for easy length cuts, swept tested to 3000 MHz, 60% aluminum braiding, 100% shielded and works outstandingly for all of your cabling needs.&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:15:40', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:58:47', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4057, 'post', 'ground-wire-copper-14-awg-green-jacket-500-ft', NULL, 3484, 'Ground Wire, Copper, 14 AWG, Green Jacket, 500 FT', 'Wire, Ground, 14 AWG, Solid Copper, 20 to 25 Amps, 8 lbs, Green', '2012-02-19 19:15:41', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:58:50', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4058, 'post', 'rg11-60percent-maxpipe-pe-burial-black-1000-ft-reel', NULL, 3484, 'RG11 60% MaxPipe PE Burial Black- 1000 FT Reel', '&lt;p&gt;&lt;span style=&quot;line-height: 115%; font-family: Calibri; font-size: 11pt; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA&quot;&gt;This black, single, underground RG11 coax cable is SCTE approved, UL Listed, has a copper clad steel center conductor, a dual foil shielding combined with #34 AWG aluminum braid and comes in an easy to use 1000&amp;rsquo; pull box with internal rolling reel. This cable has a PE jacket combined with outdoor protectant, foamed polyethylene, foot markings for easy length cuts, it is swept tested 5MHz - 3 GHz, 60% aluminum braiding, 100% shielded and works wonders for all of your cabling needs.&lt;/span&gt;&lt;/p&gt;', '2012-02-19 19:15:41', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:58:54', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4059, 'post', 'rg11-60percent-maxpipe-072-messenger-black-1000-ft-reel', NULL, 3484, 'RG11 60% MaxPipe .072 Messenger Black- 1000 FT Reel', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;This black, single, RG-11&amp;nbsp;60% coax cable is UL Listed, has a copper clad steel center conductor, a galvanized steel messenger wire for aerial installs, is SCTE compliant, includes footage markers every 2&amp;rsquo; and comes in an easy to use 1000&amp;rsquo; pull box with internal rolling reel.&amp;nbsp;It is swept tested 5MHz &amp;ndash; 3000MHz, has a UV resistant PVC jacket and a gas injected foam PE dielectric. Excellent coax for all of your cabling needs!&lt;/div&gt;', '2012-02-19 19:15:41', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:58:57', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4060, 'post', 'rca-compact-rf-modulator', NULL, 3484, 'RCA, Compact RF Modulator', '&lt;p&gt;&lt;span style=&quot;line-height: 115%; color: #333333; font-size: 11pt&quot;&gt;A compact modulator device allows connection of an audio/video component, especially for a TV that''s not equipped with an audio video jack. It&amp;rsquo;s high performance circuit design provides accurate picture reproduction.&amp;nbsp;It''s ideal for DVD players, gaming, digital cameras or camcorders and mounts easily to a wall. No flipping through the remote as this component automatically switches when it detects an incoming video source. &lt;/span&gt;&lt;/p&gt;', '2012-02-19 19:15:42', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:59:00', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4061, 'post', 'holland-3-way-splitter-vertical-5-2150-mhz', NULL, 3484, 'Holland, 3-Way Splitter, Vertical(5-2150 MHz)', '&lt;p&gt;&lt;font size=&quot;2&quot;&gt;3 Sigma high performance satellite passives are designed for distribution of digital satellite signals in application where signal integrity is critical.The HRS and HRvS Series splitters utilize diode protected circuitry to prevent DC backfeeding.&lt;/font&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;&lt;font size=&quot;2&quot;&gt;Wideband Operation (15 MHz to 2150 MHz)&amp;nbsp;&lt;/font&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;font size=&quot;2&quot;&gt;High Return Loss (15 dB @ 2 GHz Typical) &lt;/font&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;font size=&quot;2&quot;&gt;Frequency-Flat Response (&amp;plusmn;0.1 dB in any 24 MHz) &lt;/font&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;font size=&quot;2&quot;&gt;Flat &amp;ldquo;F&amp;rdquo; Ports with 1&amp;rdquo; Spacing&lt;/font&gt;&lt;/li&gt;\r\n    &lt;li&gt;Solder Back Case (130 dB RFI Shielding)&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:15:42', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:59:08', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4062, 'post', 'cei-ha8-3-1x8-1-3b-hdmi-audio-video-distribution-amp', NULL, 3484, 'CEI, (HA8-3)1x8 1.3b HDMI Audio-Video Distribution Amp', '&lt;p&gt;&lt;span style=&quot;font-weight: normal; font-size: 10px; font-style: normal; font-family: tahoma,arial,helvetica,sans-serif&quot;&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;&lt;span style=&quot;font-weight: normal; font-size: 10px; font-style: normal; font-family: tahoma,arial,helvetica,sans-serif&quot;&gt;Enhanced Amplified signals for longer cable runs&lt;/span&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;span style=&quot;font-weight: normal; font-size: 10px; font-style: normal; font-family: tahoma,arial,helvetica,sans-serif&quot;&gt;Compliant with HDMI&amp;trade;/HDCP requirements&lt;/span&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;span style=&quot;font-weight: normal; font-size: 10px; font-style: normal; font-family: tahoma,arial,helvetica,sans-serif&quot;&gt;Supports high-resolution displays of UXGA, 480i, 480p, 720p, 1080i, 1080p&lt;/span&gt;&lt;/li&gt;\r\n    &lt;li&gt;&lt;span style=&quot;font-weight: normal; font-size: 10px; font-style: normal; font-family: tahoma,arial,helvetica,sans-serif&quot;&gt;Secure HDMI&amp;trade; connection with integrated cable retention bracket&lt;/span&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;/span&gt;&lt;/p&gt;', '2012-02-19 19:15:43', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:59:10', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL);
