(4063, 'post', 'holland-digital-to-analog-mini-demodulator-54-806mhz-8-db', NULL, 3484, 'Holland, Digital to Analog Mini Demodulator(54-806MHz, 8 dB)', '&lt;ul&gt;\r\n    &lt;li&gt;Permits delivery of digital television signals in analog format directly to a television&lt;/li&gt;\r\n    &lt;li&gt;Interfaces easily with existing analog modulators on CATV networks&lt;/li&gt;\r\n    &lt;li&gt;Allows for the reception and demodulation of an 8VSB(Off-air SD/HD digital TV signal) or QAM(Digital CATV) signal into a baseband NTSC video and audio output&lt;/li&gt;\r\n    &lt;li&gt;SAW Filtered&lt;/li&gt;\r\n    &lt;li&gt;PLL Controlled Oscillator&lt;/li&gt;\r\n    &lt;li&gt;Front Panel Controls&lt;/li&gt;\r\n    &lt;li&gt;Low Out-of-Band Noise&lt;/li&gt;\r\n    &lt;li&gt;LED Channel Display&lt;/li&gt;\r\n    &lt;li&gt;Microprocessor Controlled&lt;/li&gt;\r\n    &lt;li&gt;Five-Year Warranty&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:15:43', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:59:16', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4064, 'post', 'foxcom-5l-band-4dbm-tx-cwdm-16-way-split-5-jumper-lgx-3', NULL, 3484, 'Foxcom,5L-Band +4dBm TX, CWDM, 16 Way Split, 5 Jumper, LGX-3', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;A single transmitter that can transport up to 5 L-band signals over a single fiber using CWDM technology anchors the compact kits. The transmitter is low profile and wall mountable, no racks or chassis required for head end build out.&amp;nbsp;Models are available that can also transmit CATV and SMATV programming. It is designed for deployments in both small and medium buildings.&amp;nbsp;These&amp;nbsp;transmitters are a cost competitive solution to traditional coaxial cable deployments. They are a&amp;nbsp;stand-alone based configuration making it an ideal solution for both small and&amp;nbsp;medium sized&amp;nbsp;buildings.&lt;/div&gt;\r\n&lt;p&gt;&lt;span style=&quot;line-height: 115%; font-size: 11pt&quot;&gt;The AL5T3 compact series of transmitters are low profile and wall mountable providing a cost effective method of delivering transport for small and medium distribution systems where a traditional headend cannot be installed.&amp;nbsp;The AL5T3 compact series of transmitters can be deployed in applications such as small and medium MDU&amp;rsquo;s.&lt;/span&gt;&lt;/p&gt;', '2012-02-19 19:15:44', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:59:17', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4065, 'post', 'coax-rg6-solid-copper-dual-500-feet-dtv-black', NULL, 3484, 'Coax RG6 Solid Copper - Dual 500 Feet DTV Black', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;&lt;span&gt;&lt;font size=&quot;+0&quot;&gt;This black, dual, RG-6 coax cable is UL Listed, has a solid copper conductor wire, DIRECTV approved, SBCA compliant and comes in an easy to use 500&amp;rsquo; pull box with internal rolling reel. &lt;/font&gt;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;&amp;nbsp;&lt;/div&gt;', '2012-02-19 19:15:44', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:59:21', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4066, 'post', 'holland-2-way-moca-vertical-splitter-2-2150-mhz', NULL, 3484, 'Holland, 2 Way MoCA Vertical Splitter(2-2150 Mhz)', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;line-height: normal; margin: 0in 0in 0pt&quot;&gt;This 2-way splitter was specifically designed to work in conjunction with DIRECTV&amp;rsquo;s&amp;trade; single wire multi-switch technology (SWM) within Commercial MDU applications. Holland Electronics worked closely with DIRECTV&lt;span&gt;&amp;trade; and the MoCA Alliance to develop a splitter with on-board MoCA capabilities. Used after a standard SWM module, or after DIRECTV&amp;rsquo;s&amp;trade; new SWM-integrated dish, this splitter allows you to split the outputs. With sealed F-ports, performance-tested plating and rugged cases, this splitter can be used indoors as well as in harsh outdoor environments. DIRECTV approved.&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:15:45', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:59:25', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4067, 'post', 'winegard-preamp-u-v-25-40-miles-17-db-vhf-19-db-uhf-20120219155948', NULL, 3484, 'Winegard, Preamp, U-V(25-40 Miles)(17 dB VHF, 19 dB UHF)', '&lt;ul&gt;\r\n    &lt;li&gt;Variable FM Trap&lt;/li&gt;\r\n    &lt;li&gt;Durable construction, mounts directly to TV antenna mast&lt;/li&gt;\r\n    &lt;li&gt;Made of high impact ABS material, mast mounted for easy installation&lt;/li&gt;\r\n    &lt;li&gt;Maximum Total Input for VHF 110,000 V UHF 93,000 V&lt;/li&gt;\r\n    &lt;li&gt;Used to overcome any losses in coax cable from the antenna to your TV.&lt;/li&gt;\r\n    &lt;li&gt;Includes Pre-amp, power supply, and 6 foot coax cable&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:45', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 15:59:49', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4068, 'post', 'adapter-f-female-to-rca-male-each-20120219160119', NULL, 3484, 'Adapter,F Female to RCA Male (Each)', '&lt;p&gt;&amp;bull; This product allows you to make a coax line into a RCA line.&lt;br /&gt;\r\n&amp;bull; Put the connector onto the coax as normal. That connector&lt;br /&gt;\r\n&amp;nbsp; can then be put into this part to convert it into a male RCA connection.&lt;br /&gt;\r\n&amp;bull; Makes Audio Vision Connections FAST &amp;amp; EASY&lt;/p&gt;', '2012-02-19 19:15:45', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:01:19', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
