(4301, 'post', 'silicone-dielectric-compound-5-3-oz-boss-440-clear-20120219164957', NULL, 3484, 'Silicone Dielectric Compound 5.3 Oz (Boss 440 Clear)', '&lt;ul&gt;\r\n    &lt;li&gt;Silicon dioxide thickened dimethyl polysiloxane based material&lt;/li&gt;\r\n    &lt;li&gt;Smooth, easily spreadable dielectric compound, useful as a protectorant for electrical circuitry&lt;/li&gt;\r\n    &lt;li&gt;Designed for use as a protectorant compund for electronic and electrical apparatus to prevent electrical power from migrating between circuitry&lt;/li&gt;\r\n    &lt;li&gt;Found use on switches, high voltage insulators, battery terminals, meters, electrical connectors, buss bar and many other electrical components&lt;/li&gt;\r\n    &lt;li&gt;Excellent release agent and lubricant for plastics, rubbers and glass&lt;/li&gt;\r\n    &lt;li&gt;Heat stable, chemically inert, water repellent - offers superior protection&lt;/li&gt;\r\n    &lt;li&gt;5.3 oz. tube&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:15:46', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:49:57', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4070, 'post', 'ppc-3-8inch-9-525-mm-port-seal-bag-of-100', NULL, 3484, 'PPC, 3-8inch(9.525 mm) Port Seal(Bag of 100)', '&lt;ul&gt;\r\n    &lt;li&gt;PPC&amp;rsquo;s port seals are designed for use with all PPC connectors.&lt;/li&gt;\r\n    &lt;li&gt;The patented sealing element design of these port seals offers longevity sealing for both the tap port and the drop connector.&lt;/li&gt;\r\n    &lt;li&gt;Available for 3/8&amp;quot; ports&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:15:47', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:01:52', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
