(4074, 'post', 'hdmi-to-hdmi-cable-10-meter', NULL, 3484, 'HDMI TO HDMI CABLE (10 METER)', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;Connectors: HDMI male to HDMI male.\r\n    &lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n    &lt;/li&gt;\r\n    &lt;li&gt;CL3-rated for in-wall applications (in long lengths).\r\n    &lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n    &lt;/li&gt;\r\n    &lt;li&gt;Passes broadcast high-resolution digital video, digital audio, and intercomponent control signals all in one compact connection.\r\n    &lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n    &lt;/li&gt;\r\n    &lt;li&gt;Double shielded, 85% copper braided and 100% Mylar (R) Aluminum foil provides complete immunity to environmental EMI and RFI.\r\n    &lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n    &lt;/li&gt;\r\n    &lt;li&gt;24-karat gold-plated connectors ensure superior signal transfer and a lifetime of maximum performance.\r\n    &lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n    &lt;/li&gt;\r\n    &lt;li&gt;Nitrogen-injected dielectric and quality construction make this interconnect the only choice for all home installations.&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:15:49', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:02:14', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
