(4081, 'post', 'magnepull-magnetic-cable-puller-new-xp-model', NULL, 3484, 'Magnepull Magnetic Cable Puller - New XP Model', '&lt;p&gt;Magnepull cable retrieval system reduces cable installations time as much as 70% as compared to a standard fish tape. This new tool magnetically couples the cable-pulling device through drywall and allows the technicians to have complete control. The system was developed to work with metal studs and in insulated walls. Replaces the skill based method of wire fishing with a definable process that can be taught in one hour.&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;Reduces cable fishing time by 70%&lt;/li&gt;\r\n    &lt;li&gt;Eliminates wall damage due to misplaced holes&lt;/li&gt;\r\n    &lt;li&gt;Reduces training time to one hour&lt;/li&gt;\r\n    &lt;li&gt;Allows for installations in confined spaces&lt;/li&gt;\r\n    &lt;li&gt;Eliminates the need for a stud finder&lt;/li&gt;\r\n    &lt;li&gt;Reduces time in attic during installation of cable and wire&lt;/li&gt;\r\n    &lt;li&gt;Makes wire fishing a definable process&lt;/li&gt;\r\n    &lt;li&gt;Pulls under carpet&lt;/li&gt;\r\n    &lt;li&gt;INCLUDES: Case, Retriever Unit, 1 Bullet Magnet with leader and Jack Chain.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:15:52', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:02:47', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4082, 'post', 'rg6-60percent-maxpipe-ul-ccs-single-1000ft-black', NULL, 3484, 'RG6 60% Maxpipe UL CCS, Single 1000ft, BLACK', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;This black, single RG-6 60% coax cable is UL Listed, has a copper clad steel center conductor wire, footage markers for easy length cuts and comes in an easy to use 1000&amp;rsquo; pull box with internal rolling reel.&amp;nbsp;This cable has a UV resistant PVC jacket, a gas injected foamed polyethylene dielectric and is swept tested 5MHz &amp;ndash; 3000MHz.&lt;/div&gt;', '2012-02-19 19:15:52', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:02:52', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
