(4097, 'post', 'holland-ground-block-dual-w-3-grd-lugs-hf-ul', NULL, 3484, 'Holland, Ground Block, Dual w-3 Grd Lugs HF UL', '&lt;p&gt;&lt;span style=&quot;line-height: 115%; font-size: 11pt&quot;&gt;This dual ground block, manufactured by Holland, allows two coaxial cables to be grounded by the same ground block.&amp;nbsp;It has three different places that the ground wire can connect to.&amp;nbsp;Use this item with other grounding supplies to protect against lightning strikes and power surges.&lt;/span&gt;&lt;/p&gt;', '2012-02-19 19:15:59', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:05:41', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
