(4100, 'post', 'belden-rg6-sc-plenum-60percent-braid-3-ghz-1000-rl-white', NULL, 3484, 'Belden RG6 SC Plenum 60% Braid, 3 GHZ  -1000'' rl,White', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;This white, single, RG-6 SC Plenum coax cable has a solid copper center conductor, is DIRECTV approved, UL Listed, has a 60% braid and comes 1000&amp;rsquo; per reel.&lt;b&gt;&amp;nbsp;&lt;/b&gt;This cable has a Flamarrest jacket, the dielectric is foam FEP and it is swept tested to 3 GHz.&lt;/div&gt;', '2012-02-19 19:16:00', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:05:52', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4101, 'post', 'perfect-vision-3-tripod-kit-w-28inchx1-5-8inch-od-pole-included', NULL, 3484, 'Perfect Vision, 3'' Tripod Kit w-28inchx1 5-8inch OD Pole Included', '\r\nThis heavy-duty tripod is used to mount satellite antennas or off-air antennas. It is super sturdy, made of 18 gauge steel. The 3’ tripod includes a 28” x 1 5/8” O.D. mast although it accommodates a mast up to 2” O.D. DIRECTV™ approved. ', '2012-02-19 19:16:01', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:05:54', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4102, 'post', 'sonora-trunk-amplifier-w-1a-smps-supply-250-2150-mhz-mfh2', NULL, 3484, 'Sonora, Trunk Amplifier w-1A SMPS Supply(250-2150 MHz)(MFH2)', '&lt;p&gt;&lt;span style=&quot;line-height: 115%; font-size: 11pt&quot;&gt;This self-adjusting in-line amplifier simplifies MDU installations by automatically adjusting the gain control for optimum signal levels.&amp;nbsp;It is weather sealed in a die-cast housing and includes variable color signal indicators.&amp;nbsp;It also has a F connector power input and dual 10 AWG ground lugs.&lt;/span&gt;&lt;/p&gt;', '2012-02-19 19:16:01', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:06:10', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4103, 'post', 'hdmi-to-hdmi-copperhead-xtreme-cable-3d-and-ethernet-2-meter', NULL, 3484, 'HDMI to HDMI Copperhead Xtreme Cable, 3D and Ethernet, 2 Meter', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 12pt&quot;&gt;High-speed HDMI 1.4 with Ethernet, 3D and fully backwards compatibility offers fast and accurate high quality cable.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 12pt&quot;&gt;&lt;span style=&quot;color: black&quot;&gt;Design is fully compliant with HDMI standards for maximum performance&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 12pt&quot;&gt;Supporting HDTV resolutions up to 1440p for both audio and video data transmission allows for the highest quality image.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 12pt&quot;&gt;DPL Labs Certified for superior value.&lt;/span&gt;&lt;/p&gt;', '2012-02-19 19:16:01', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:06:12', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4104, 'post', 'ground-wire-copper-12-awg-green-jacket-500-ft', NULL, 3484, 'Ground Wire, Copper, 12 AWG, Green Jacket, 500 FT', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;500&amp;rsquo; reel of 12 AWG solid copper core ground wire with heavy duty green cover. Use in conjunction with other grounding supplies to protect against lightning strikes and power surges.&lt;/div&gt;', '2012-02-19 19:16:02', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:06:15', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4105, 'post', 'directv-hd-dvr-receiver-w-phone-hdmi-composite-component', NULL, 3484, 'DirecTV, HD-DVR Receiver w-Phone-HDMI-Composite-Component', 'Supercharge your High-Def TV with state-of-the-art HD DVR receiver. Your HDTV alone won''t give you an HD picture. You need HD service and an HD receiver.', '2012-02-19 19:16:02', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:06:46', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4106, 'post', 'compass-and-angle-finder-combo-suunto', NULL, 3484, 'Compass and  Angle Finder, Combo Suunto', 'The Suunto high precision site survey tool is both a compass and a clinometer (angle finder).  It is a precision liquid filled instrument with both functions built into the same housing. This device is excellent for the satellite installers! DIRECTV approved.', '2012-02-19 19:16:03', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:06:51', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
(4107, 'post', 'ppc-compression-f-conn-universal-plenum-rg6-bag-of-50-20120219161205', NULL, 3484, 'PPC, Compression F Conn, Universal, Plenum(RG6)(Bag of 50)', '&lt;ul&gt;\r\n    &lt;li&gt;Universal Compression Connector can be used on all RG6 Coaxial Cables with 60%, Tri and Quad-Shield for maximum versatility.&lt;/li&gt;\r\n    &lt;li&gt;DIRECTV approved&lt;/li&gt;\r\n    &lt;li&gt;Uses the O ring as a redundant seal and is always compression sealing, regardless of torque for durability.&lt;/li&gt;\r\n    &lt;li&gt;A gas tight secondary seal connection between the nut and the post achieves ultimate protection.&lt;/li&gt;\r\n    &lt;li&gt;Large tapered compression area creates a secure, moisture tight interface at the back of the connector&lt;/li&gt;\r\n    &lt;li&gt;Three circumferential gaskets seal the body to the post creating a useful design.&lt;/li&gt;\r\n    &lt;li&gt;True 360&amp;deg; compression onto cable ensures superior RF shielding performance&lt;/li&gt;\r\n    &lt;li&gt;Incorporates an iridescent chromate finish plus UV resistant plastic to provide a reliable, environmentally sealed product.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:16:03', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:12:06', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
