(4119, 'post', 'gilbert-ultra-ease-f-conn-mini-eaches', NULL, 3484, 'Gilbert Ultra Ease F-Conn Mini Eaches', '&lt;p&gt;&amp;bull; Gilbert Ultra Ease Pin Type &amp;quot; F &amp;quot; &lt;br /&gt;\r\n&amp;bull; Sealing system passes the SCTE interface moisture migration test&lt;br /&gt;\r\n&amp;bull; A free-spinning sealed nut design&lt;br /&gt;\r\n&amp;nbsp; permits the 7/16&amp;rdquo; nut to spin freely for&lt;br /&gt;\r\n&amp;nbsp; easy installation. The o-ring seals when tightened&lt;br /&gt;\r\n&amp;bull; 360&amp;ordm; radial compression at the connector/&lt;br /&gt;\r\n&amp;nbsp; cable interface provides excellent RF&lt;br /&gt;\r\n&amp;nbsp; shielding and prevents moisture migration&lt;br /&gt;\r\n&amp;bull; Exposed components constructed of brass&lt;br /&gt;\r\n&amp;bull; One piece construction eliminates lost components&lt;br /&gt;\r\n&amp;bull; One connector for both indoor and outdoor applications&lt;br /&gt;\r\n&amp;bull; One step cable preparation&lt;br /&gt;\r\n&amp;bull; Longer hex flats facilitates easier nstallation&lt;br /&gt;\r\n&amp;bull; Push out pin eliminates blind entry&lt;br /&gt;\r\n&amp;bull; Uses standard tools&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;', '2012-02-19 19:16:09', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:12:34', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL);
