(4212, 'post', 'winegard-30-inch-dish-d-tube-feed-20120219161721', NULL, 3484, 'Winegard, 30 Inch Dish(D Tube Feed)', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;div style=&quot;margin: 0in 0in 10pt&quot;&gt;&lt;span&gt;This 30&amp;rdquo; satellite receiving antenna dish system utilizes a D-tube feed support.&amp;nbsp;This dish is designed using the CAD-CAM process.&amp;nbsp;Galvanized steel, used in the manufacturing process, is carbon sheet steel with a zinc-iron alloy coating.&amp;nbsp;Corrosion resistant, these alloys react to scratches and other damage through galvanic action between steel and zinc &amp;ndash; the zinc protects breaks in the coating and prevents further damage after installation.&lt;/span&gt;&lt;/div&gt;', '2012-02-19 19:16:58', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:17:21', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL);
