(4250, 'post', 'rg11-60percent-maxpipe-pe-burial-black-1000-ft-reel-20120219162010', NULL, 3484, 'RG11 60% MaxPipe PE Burial Black- 1000 FT Reel', '&lt;p&gt;&lt;span style=&quot;line-height: 115%; font-family: Calibri; font-size: 11pt; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA&quot;&gt;This black, single, underground RG11 coax cable is SCTE approved, UL Listed, has a copper clad steel center conductor, a dual foil shielding combined with #34 AWG aluminum braid and comes in an easy to use 1000&amp;rsquo; pull box with internal rolling reel. This cable has a PE jacket combined with outdoor protectant, foamed polyethylene, foot markings for easy length cuts, it is swept tested 5MHz - 3 GHz, 60% aluminum braiding, 100% shielded and works wonders for all of your cabling needs.&lt;/span&gt;&lt;/p&gt;', '2012-02-19 19:17:16', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:20:10', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
