(4254, 'post', 'ripley-lightweight-drop-trimmer-5-16inch-x-1-4inch-prep-rg59-rg6', NULL, 3484, 'Ripley, Lightweight Drop Trimmer 5-16inch x 1-4inch Prep(RG59,RG6)', '&lt;p&gt;&lt;span style=&quot;line-height: 115%; color: black; font-size: 11pt&quot;&gt;This cable preparation tool is factory calibrated to remove the right amount of cable jacket, cut the braid and dielectric to the precise length, and expose the center conductor in one smooth step.&amp;nbsp;The center conductor is exposed by 5/16&amp;rdquo; (7.93mm) and 1/4&amp;rdquo; (6.35mm) of the cable jacket is removed.&amp;nbsp;It&amp;rsquo;s lightweight and compact body design allows cable preparation of series 59, 6, N48, Coax 9, standard, tri-shield and quad shield coax without adjusting or changing the blade. The superior quality steel blade cassettes will perform 3,500+ cable preparations under normal use.&amp;nbsp;It is made in the U.S.A.&lt;/span&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n    &lt;li&gt;Replacement cassette part number RCEUR-250 - Color Orange&lt;/li&gt;\r\n&lt;/ul&gt;', '2012-02-19 19:17:18', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:20:22', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
