(4260, 'post', 'reference-point-locator-ms800', NULL, 3484, 'Reference Point Locator (MS800)', '&lt;p&gt;&lt;span style=&quot;font-size: x-small&quot;&gt;&lt;font face=&quot;Swiss721BT-LightCondensed&quot;&gt;&amp;bull; The Magnespot reference point&lt;br /&gt;\r\n&amp;nbsp; locator is used to locate a Reference&lt;br /&gt;\r\n&amp;nbsp; Marker through structure such as sheetrock or flooring.&lt;br /&gt;\r\n&amp;bull; Locates Reference Marker up to a distance to 3 inches or more.&lt;br /&gt;\r\n&amp;bull; Reduces time in the attic.&lt;br /&gt;\r\n&amp;bull; Helps eliminates wall damage due to misplaced holes.&lt;br /&gt;\r\n&amp;bull; Works well for speaker placement.&lt;br /&gt;\r\n&amp;bull; Reduces trips to the attic.&lt;br /&gt;\r\n&amp;bull; Can be used with reusable adhesive&lt;br /&gt;\r\n&amp;nbsp; to eliminate Reference Marker pin.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;', '2012-02-19 19:17:21', 'y', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, '2012-02-19 16:20:37', 'n', NULL, NULL, 12, 12, 'y', 'y', NULL, NULL, 'n', NULL, 'y', 'n', 'n', NULL, NULL),
